-- ----------------------------
-- Procedure structure for ateAuxPedidos
-- ----------------------------
DROP PROCEDURE IF EXISTS `ateAuxPedidos`;
delimiter ;;
CREATE PROCEDURE `ateAuxPedidos`(IN auxiliar int)
begin
select
ap.id_atencion_pedidos,
ap.conductor,
ap.auxiliar,
ap.unidad,
pe.id_persona
from atencion_pedidos ap
LEFT JOIN vehiculos vh on ap.unidad = vh.id_vehiculo
LEFT JOIN personas pe on ap.id_auxiliar= pe.id_persona

where ap.auxiliar = auxiliar;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for atePedidos
-- ----------------------------
DROP PROCEDURE IF EXISTS `atePedidos`;
delimiter ;;
CREATE PROCEDURE `atePedidos`(IN id_pedido_cliente int)
begin
select
ap.id_atencion_pedidos,
ap.conductor,
ap.auxiliar,
ap.unidad,
pe.id_persona
from atencion_pedidos ap
LEFT JOIN vehiculos vh on ap.unidad = vh.id_vehiculo
LEFT JOIN personas pe on ap.id_auxiliar= pe.id_persona

where ap.id_pedido_cliente = id_pedido_cliente;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for BuscarDireccion
-- ----------------------------
DROP PROCEDURE IF EXISTS `BuscarDireccion`;
delimiter ;;
CREATE PROCEDURE `BuscarDireccion`(IN entidad int)
BEGIN
			select 
		d.id_direccion,
			e.razon_social,
				d.direccion,
			u.nombre_provincia,
		u.nombre_distrito, 
		d.urbanizacion, 
		(select count(*) from direcciones where fecha_del is null) as total
			from direcciones d
			LEFT join entidades e on d.id_entidad = e.id_entidad
			LEFT join ubigeos u on d.id_ubigeo = u.id_ubigeo
			where d.fecha_del is null and e.id_entidad=entidad ORDER BY id_direccion DESC;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for BuscarGuiaCliente
-- ----------------------------
DROP PROCEDURE IF EXISTS `BuscarGuiaCliente`;
delimiter ;;
CREATE PROCEDURE `BuscarGuiaCliente`(IN serie int, IN numero int)
BEGIN
select 
	g.fecha,
	concat(g.serie,'-',g.numero_guia) as numero_guia,
	g.fecha as fecha_traslado,
	r.razon_social as remitente,
	r.numero_documento as doc_remitente,
	(SELECT direccion FROM direcciones WHERE id_direccion = 1726 ) as direccion_partida,
	 
	gvd.nombres_destinatario as destinatario,
 	gvd.numero_documento as doc_destinatario,
  
	concat(p.nombres,' ',p.apellido_paterno,' ',p.apellido_materno) as conductor,
	e.licencia,
	vm.nombre_marca as marca,
	gvd.observacion,
	v.placa,
	dgv.peso,
	dgv.cantidad,
	if( ag.cuenta is null, gvd.direccion_destinatario,ag.cuenta ) as direccion_llegada,
	va.nombre_via as via ,
	es.id_estado,
	g.comentario,
	esv.id_estado_venta,
	ar.ruta_archivo,
	ar.nombre_archivo,
	CONCAT(ar.ruta_archivo,'',ar.nombre_archivo) nombre_ruta,
	ar.id_archivo,
	g.factura_boleta
	 
	
from guia_venta g
LEFT join clientes_ventas r on g.id_entidad_ = r.id_entidad
LEFT join empleados e on g.id_conductor = e.id_empleado
LEFT JOIN guia_venta_destino gvd on g.id_guia_venta = gvd.id_guia_remision
LEFT join detalle_guia_venta dgv on g.id_guia_venta = dgv.id_guia_venta
LEFT join personas p on e.id_persona = p.id_persona
LEFT join vehiculos v on g.id_vehiculo = v.id_vehiculo
LEFT join marca_vehiculo vm on v.id_marca = vm.id_marca
LEFT join direcciones dr on r.id_entidad = dr.id_entidad
LEFT JOIN  agente ag on gvd.id_agente = ag.id_agente
LEFT JOIN via va on dgv.id_forma_envio = va.id_via
LEFT join estados es on g.id_estado = es.id_estado
LEFT join estados_venta esv on g.id_estados_venta = esv.id_estado_venta
LEFT join archivo ar on g.id_archivo = ar.id_archivo


where g.serie=serie and g.numero_guia = numero 
and g.fecha_del is null 
and gvd.fecha_del is null 
and dgv.fecha_del is null 
and p.fecha_del is null 
and v.fecha_del is nulland vm.fecha_del is null
and dr.fecha_del is null
and ag.fecha_del is null
and va.fecha_del is null
;

end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for cierreCaja
-- ----------------------------
DROP PROCEDURE IF EXISTS `cierreCaja`;
delimiter ;;
CREATE PROCEDURE `cierreCaja`(IN fecha CHAR(20), IN serie VARCHAR(20))
BEGIN
 		
SELECT
	CONCAT('') as ITEM,
	vf.serie,	
  if(vf.serie ='004',CONCAT(vf.serie,'-',vf.correlativo),'') AS N_FACTURA,
	if(vf.serie ='005',CONCAT(vf.serie,'-',vf.correlativo),'') AS N_BOLETA,	
	concat(gr.serie,'-', gr.numero_guia ) AS GUIA_PEGASO,
 	r.razon_social as NOMBRE_RAZON_SOCIAL,
	(dgv.monto_envio/1.18) as SUB_TOTAL,
	dgv.monto_envio-(dgv.monto_envio/1.18) AS IGV,
	dgv.monto_envio AS TOTAL,
	if(fp.forma_pago ='Efectivo',dgv.monto_envio,'' ) AS EFECTIVO, 
	if(fp.forma_pago ='YAPE',dgv.monto_envio,'' ) AS YAPE,
	if(fp.forma_pago ='IZIPAY',dgv.monto_envio,'' ) AS IZIPAY,
	if(fp.forma_pago ='Deposito',dgv.monto_envio,'' ) AS DEPOSITO,
	if(fp.forma_pago ='Contra Entrega',dgv.monto_envio,'' ) AS Contra_Entrega 
 
	FROM
		guia_venta gr
		 
		LEFT JOIN clientes_ventas r ON gr.id_entidad_ = r.id_entidad 
		LEFT JOIN detalle_guia_venta dgv ON gr.id_guia_venta = dgv.id_guia_venta
		LEFT JOIN forma_pago fp on gr.id_forma_pago = fp.id_forma_pago
		LEFT JOIN ventas_factura  vf on gr.id_guia_venta = vf.id_guia_ventas

	WHERE
		gr.fecha_del IS NULL 
		AND gr.fecha = fecha and gr.serie=serie;	   
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultaatepedidos
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaatepedidos`;
delimiter ;;
CREATE PROCEDURE `consultaatepedidos`(IN id_atencion_pedidos INT)
BEGIN
		 
SELECT
	ap.id_atencion_pedidos,
	ap.id_pedido_cliente,
	ap.conductor,
	ap.auxiliar,
	ap.unidad,
	ep.id_empleado,
	pe.nombres,
	pc.nm_solicitud,
	pc.id_cliente,
	en.razon_social,
	pc.id_remitente as id_remitente,
	enr.razon_social as remitente,
	dr.id_direccion as id_direccion_partida,
	dr.direccion as direccion_partida,
	epc.id_empleado as id_conductor,
	CONCAT(pec.nombres,' ',pec.apellido_paterno,' ', pec.apellido_materno ) as nombre_conductor,
	vh.id_vehiculo,
	CONCAT(vh.placa,' - ',vh.descripcion) as vehiculo
	 
FROM
	atencion_pedidos ap
	LEFT JOIN vehiculos vh ON ap.unidad = vh.id_vehiculo
  LEFT JOIN empleados ep ON ap.auxiliar = ep.id_empleado
	LEFT JOIN personas pe ON ep.id_persona = pe.id_persona 
	left join pedido_cliente pc on ap.id_pedido_cliente = pc.id_pedido_cliente
	left join entidades en on pc.id_cliente = en.id_entidad
	left join entidades enr on pc.id_remitente = enr.id_entidad
	left join direcciones dr on pc.id_direccion_recojo = dr.id_direccion
  LEFT JOIN empleados epc ON ap.conductor = epc.id_empleado
	LEFT JOIN personas pec ON epc.id_persona = pec.id_persona 
WHERE
	ap.fecha_del IS NULL 
	AND ap.id_atencion_pedidos = id_atencion_pedidos;
	
	end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultaFactura
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaFactura`;
delimiter ;;
CREATE PROCEDURE `consultaFactura`(IN idFactura INT)
BEGIN
	select 
	vf.id_ventas_factura,
	vf.serie,
	vf.correlativo,
	vf.tipo_comprobante,
	vf.fecha,
	vf.id_guia_ventas,
  case gv.id_forma_pago  
         when 1 then 'contado'  
         when 2 then 'contado'  
         when 3 then 'contado' 
				 when 6 then 'contado'  
	       when 4 then 'credito'  
         when 5 then 'credito'  
         end as forma_pago,
				 
   if(gv.id_forma_pago=5,tdd.id_tipo_documento,td.id_tipo_documento) as id_documento,			
				if(gv.id_forma_pago=5,tdd.documento,td.documento) as documento, 
				cv.correo,
				cv.telefono,
				CONCAT('soles') as tipo_moneda,
					CONCAT('UNIDAD') AS unidad, 
	vf.igv,
	vf.cliente,
 	vf.numero_documento,
	vf.total as total_m,
		vf.subtotal as subtotal,
	vf.fecha_reg, 
  ef.descripcion as estado,
	ef.codigo as estado_codigo,
 vf.total as total_monto
 
	from ventas_factura vf
	LEFT JOIN estados_factura ef on vf.estado = ef.id_estado_factura
	
	LEFT JOIN guia_venta gv on vf.id_guia_ventas = gv.id_guia_venta
	inner join clientes_ventas cv on gv.id_entidad_ = cv.id_entidad
	inner join tipo_documentos td on gv.id_tipo_documento_remitente = td.id_tipo_documento
		left join guia_venta_destino gvd on gv.id_guia_venta = gvd.id_guia_remision
  left join tipo_documentos tdd on gvd.id_tipo_documento = tdd.id_tipo_documento
  where vf.fecha_del is null and vf.id_ventas_factura=idFactura ORDER BY id_ventas_factura DESC;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultaFacturacion
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaFacturacion`;
delimiter ;;
CREATE PROCEDURE `consultaFacturacion`(IN id_guia INT)
BEGIN
			SELECT 
		  	gv.id_guia_venta,
				gv.fecha,
				tc.id_tipo_comprobante,
				tc.descripcion as tipo_comprobante,
		     
				 case gv.id_forma_pago  
         when 1 then 'contado'  
         when  2 then 'contado'  
         when 3 then 'contado'  
	       when 4 then 'credito'  
         when 5 then 'credito'  
         end as forma_pago,
 
				 
			  if(gv.id_forma_pago=5,tdd.id_tipo_documento,td.id_tipo_documento) as id_documento,			
				if(gv.id_forma_pago=5,tdd.documento,td.documento) as documento,
				 
				if(gv.id_forma_pago=5,CONCAT(gvd.nombres_destinatario,' ',gvd.apellidos_destinatario), cv.razon_social ) as        razon_social,
				if(gv.id_forma_pago=5,gvd.numero_documento, cv.numero_documento ) as numero_documento,
			  
				cv.correo,
				cv.telefono,
				CONCAT('soles') as tipo_moneda,
				dgv.cantidad as cantidad,
				CONCAT('UNIDAD') AS unidad,
				dgv.monto_envio,
		    ROUND( dgv.monto_envio / 1.18,2) as precio_unitario,
			  ROUND( dgv.monto_envio- (dgv.monto_envio / 1.18),2) as igv,
		    dgv.cantidad AS cantidad_pr,
		    pro.nombre_producto,
        dgv.descripcion_producto		
			 
				
				FROM guia_venta gv 
				inner join tipo_comprobante tc on gv.id_tipo_comprobante = tc.id_tipo_comprobante
				inner join tipo_documentos td on gv.id_tipo_documento_remitente = td.id_tipo_documento
				inner join clientes_ventas cv on gv.id_entidad_ = cv.id_entidad
				inner join detalle_guia_venta dgv on gv.id_guia_venta = dgv.id_guia_venta
				inner join productos pro on dgv.id_producto = pro.id_producto
				left join guia_venta_destino gvd on gv.id_guia_venta = gvd.id_guia_remision
				left join tipo_documentos tdd on gvd.id_tipo_documento = tdd.id_tipo_documento
				INNER JOIN forma_pago fp on gv.id_forma_pago = fp.id_forma_pago
				
				
				where gv.fecha_del is null and  gv.id_guia_venta=id_guia;
				
				end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultaGuiaCliente
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaGuiaCliente`;
delimiter ;;
CREATE PROCEDURE `consultaGuiaCliente`(IN id_guia INT)
BEGIN
	SELECT
		gr.nm_solicitud,
		gr.fecha,
		gr.fecha_traslado,
		concat( gr.serie, '- ', gr.numero_guia ) AS numero_guia,
		grc.gr,
		d.razon_social as destinatario,
		d.numero_documento as ruc_destinatario,
		dgr.id_entidad,
		usu.id_persona,
		gr.id_guia_remision,
		dlu.nombre_provincia AS destino,
		e.nombre_estado,
		er.razon_social as remitente,
		er.numero_documento as ruc_remitente,
		dl.direccion as id_direccion_llegada,
		dre.direccion as id_direccion_partida,
		em.id_empleado,
		perem.id_persona,
		CONCAT(perem.nombres,' ', perem.apellido_paterno,' ',perem.apellido_materno) as conductor,
		em.licencia,
		vh.id_vehiculo,
		vh.placa,
		vh.incripcion,
		mvh.nombre_marca,
		CONCAT('') as configuracion_vh,
		dgrp.id_detalle_guia,
		prd.nombre_producto,
		dgrp.cantidad as cantidad_detalle,
		prd.unidad_medida
	FROM
		guia_remision gr
		LEFT JOIN guia_remision_cliente grc ON gr.id_guia_remision = grc.id_guia_remision
		LEFT JOIN entidades d ON gr.id_destinatario = d.id_entidad
		LEFT JOIN entidades dgr ON gr.id_cliente = dgr.id_entidad
		LEFT JOIN personas pers ON dgr.id_entidad = pers.id_entidad
		LEFT JOIN usuarios usu ON pers.id_persona = usu.id_persona
		LEFT JOIN direcciones dl ON gr.id_direccion_llegada = dl.id_direccion
		LEFT JOIN ubigeos dlu ON dl.id_ubigeo = dlu.id_ubigeo
		LEFT JOIN estados e ON grc.id_estado_mercaderia = e.id_estado 
		LEFT JOIN entidades er ON gr.id_remitente = er.id_entidad
		LEFT JOIN direcciones dre ON gr.id_direccion_partida = dre.id_direccion
		left join empleados em on gr.id_conductor = em.id_empleado
		left join personas perem on em.id_persona = perem.id_persona
		left join vehiculos vh on gr.id_vehiculo = vh.id_vehiculo
		left join marca_vehiculo mvh on vh.id_marca = mvh.id_marca
		LEFT JOIN detalle_guia_remitente dgrp on grc.id_guia_remision = dgrp.id_guia_remision
	  left join productos prd on dgrp.id_producto = prd.id_producto
	WHERE
		gr.fecha_del IS NULL and grc.fecha_del is null and dgrp.fecha_del is null
		AND gr.id_guia_remision = id_guia;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultaGuiaClienteProducto
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaGuiaClienteProducto`;
delimiter ;;
CREATE PROCEDURE `consultaGuiaClienteProducto`(IN id_guia INT)
BEGIN
	SELECT
	 
 
		prd.nombre_producto,
		dgrp.cantidad as cantidad_detalle,
		prd.unidad_medida
	FROM
		guia_remision gr
		 
		 
		LEFT JOIN detalle_guia_remitente dgrp on gr.id_guia_remision = dgrp.id_guia_remision
	  left join productos prd on dgrp.id_producto = prd.id_producto
	WHERE
		gr.fecha_del IS NULL and dgrp.fecha_del IS NULL  and prd.fecha_del is null
		AND gr.id_guia_remision = id_guia;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for ConsultaGuiasRC
-- ----------------------------
DROP PROCEDURE IF EXISTS `ConsultaGuiasRC`;
delimiter ;;
CREATE PROCEDURE `ConsultaGuiasRC`(IN id_guia_remision INT, IN tipo VARCHAR(200))
BEGIN
SELECT gr.id_guia_remision as id,
CONCAT(IF(gr.serie is null,'G',gr.serie),'-',IF (gr.numero_guia is null,'G',gr.numero_guia)) as numero_guia,
gr.fecha_reg,
'' as descripcion,
'GRP' as tipo,
es.nombre_estado as estado,
gr.comentario as recibido_por,
 CONCAT(ar.ip_server,'',ar.ruta_archivo,'',ar.nombre_archivo) nombre_ruta
FROM guia_remision gr
LEFT JOIN estados es on gr.id_estado = es.id_estado
LEFT JOIN archivo ar on gr.id_archivo = ar.id_archivo
where gr.id_guia_remision = id_guia_remision
UNION ALL
SELECT grc.id_guia_remision_cliente as id,
 (case when grc.grs is null then grc.gr else concat(grc.grs,'-',grc.gr) end ) as numero_guia, 
gr.fecha_reg,
grc.descripcion,
'GRC' as tipo,
es.nombre_estado as estado,
grc.recibido_por, 
 CONCAT(ar.ip_server,'',ar.ruta_archivo,'',ar.nombre_archivo) nombre_ruta
FROM guia_remision_cliente grc
LEFT JOIN estados es on grc.id_estado_mercaderia = es.id_estado
LEFT JOIN guia_remision gr on grc.id_guia_remision = gr.id_guia_remision
LEFT JOIN archivo ar on grc.id_archivo = ar.id_archivo
where gr.id_guia_remision = id_guia_remision
and  grc.fecha_del is null;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultaGV
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaGV`;
delimiter ;;
CREATE PROCEDURE `consultaGV`(IN id_guia INT)
BEGIN
select 
 
  g.id_guia_venta, 
	g.fecha,
	g.serie,	
  fp.id_forma_pago,		
	g.numero_guia,
	g.guia_cliente,
	g.id_conductor,
	g.id_vehiculo,
	g.id_tipo_documento_remitente,
	concat(g.serie,'-',g.numero_guia) as numero_guias,
	g.fecha as fecha_traslado,
	r.razon_social as remitente,
	 
	(SELECT direccion FROM direcciones WHERE id_direccion = 1726 ) as direccion_partida,
	  
	concat(p.nombres,' ',p.apellido_paterno,' ',p.apellido_materno) as conductor,
	e.licencia,
	vm.nombre_marca as marca,
	gvd.observacion,
	v.placa,
 
	if( ag.cuenta is null, gvd.direccion_destinatario,ag.cuenta ) as direccion_llegada,
	va.nombre_via as via ,
	es.id_estado,
	g.comentario,
	
	gvd.id_guia_venta_destino,
	gvd.id_tipo_documento,
	gvd.numero_documento as numero_doc_destino,
	gvd.nombres_destinatario,
	gvd.apellidos_destinatario,
	gvd.celular_destinatario,
	gvd.id_tipo_entrega,
	gvd.id_agente,
	gvd.id_ubigeo,
	gvd.direccion_destinatario,
	gvd.observacion,
	
	dgv.id_detalle_guia_venta,
	dgv.id_producto,
	dgv.descripcion_producto,
	dgv.id_forma_envio,
	dgv.cantidad,
	dgv.peso,
	dgv.volumen,
	dgv.monto_envio,
	
	
	r.razon_social,
		r.id_entidad,
			r.numero_documento,

	tp.id_tipo_comprobante
	
from guia_venta g
inner join clientes_ventas r on g.id_entidad_ = r.id_entidad
inner join empleados e on g.id_conductor = e.id_empleado
LEFT JOIN  guia_venta_destino gvd on g.id_guia_venta = gvd.id_guia_remision
inner join detalle_guia_venta dgv on g.id_guia_venta = dgv.id_guia_venta
inner join personas p on e.id_persona = p.id_persona
inner join vehiculos v on g.id_vehiculo = v.id_vehiculo
inner join marca_vehiculo vm on v.id_marca = vm.id_marca
inner join direcciones dr on r.id_entidad = dr.id_entidad
LEFT JOIN  agente ag on gvd.id_agente = ag.id_agente
LEFT JOIN via va on dgv.id_forma_envio = va.id_via
LEFT join estados es on g.id_estado = es.id_estado
LEFT JOIN forma_pago fp on g.id_forma_pago = fp.id_forma_pago
INNER JOIN tipo_comprobante tp on g.id_tipo_comprobante = tp.id_tipo_comprobante

where g.id_guia_venta = id_guia;
end
;;
delimiter ;

