delimiter ;;
CREATE PROCEDURE `consultaNumeroDocumento`(IN numero_documento VARCHAR(50))
BEGIN

select 
			count(e.numero_documento) as total
			FROM
		entidades e 
	WHERE
		e.fecha_del IS NULL and e.numero_documento = numero_documento;

END
