-- ----------------------------
-- Procedure structure for ConsultaPedidos
-- ----------------------------
DROP PROCEDURE IF EXISTS `ConsultaPedidos`;
delimiter ;;
CREATE PROCEDURE `ConsultaPedidos`(IN id_pedido INT)
BEGIN
	SELECT
		pc.id_pedido_cliente,
		pc.id_cliente,
				pc.nm_solicitud,
		pc.fecha,
		pc.hora_recojo,
		pc.tipo_servicio,
		CONCAT(ts.cod_producto,'::',ts.nombre_producto) as servicio,
		pc.id_distrito,
		CONCAT(u.nombre_departamento,'::',u.nombre_provincia,'::',u.nombre_distrito) as distrito,
		dr.direccion as direccion_recojo,
		pc.id_direccion_recojo,
		pc.contacto,
		pc.id_area,
		ar.nombre_area,
		pc.referencia,
		pc.telefono,
		pc.cantidad_personal,
		pc.id_tipo_unidad,
		tu.descripcion as nombre_tipo_unidad,
		pc.stoka,
		pc.fragil,
		pc.cantidad,
		pc.peso,
		pc.alto,
		pc.ancho,
		pc.largo,
		pc.estado_mercaderia,
		pc.observacion,
		pc.id_estado,
		ts.nombre_producto as nombreT,
		( SELECT count( * ) FROM pedido_cliente WHERE fecha_del IS NULL ) AS total,
			if( pc.stoka=1,'SI','NO' )as valor_stoka,
				if( pc.fragil=1,'SI','NO' )as valor_fragil,
					if( pc.estado_mercaderia=1,'SI','NO' )as nom_estado_mercaderia,
					pc.notificacion,
					pc.notificacion_descarga
 
	FROM
		pedido_cliente pc
		LEFT JOIN ubigeos u ON pc.id_distrito = u.id_ubigeo 
		LEFT join productos ts on pc.tipo_servicio = ts.id_producto
		LEFT JOIN tipo_unidad tu on pc.id_tipo_unidad = tu.id_tipo_unidad
		left join areas ar on pc.id_area = ar.id_area
		left join direcciones dr on pc.id_direccion_recojo = dr.id_direccion
		
		
	WHERE
		pc.fecha_del IS NULL AND pc.id_pedido_cliente = id_pedido 
	ORDER BY
		pc.fecha_reg DESC;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for ConsultaSegAg
-- ----------------------------
DROP PROCEDURE IF EXISTS `ConsultaSegAg`;
delimiter ;;
CREATE PROCEDURE `ConsultaSegAg`(IN id_guia INT,IN tipo_tabla VARCHAR(200))
BEGIN 
SELECT
x.id,
x.numero_guia,
x.fecha_reg,
x.descripcion,
x.tipo,
x.tipo_tabla,
x.estado,
x.recibido_por,
x.nombre_ruta
FROM (SELECT gr.id_guia_remision as id,
CONCAT(IF(gr.serie is null,'G',gr.serie),'-',IF (gr.numero_guia is null,'G',gr.numero_guia)) as numero_guia,
gr.fecha_reg,
'' as descripcion,
'GRP' as tipo,
'GRP' as tipo_tabla,
es.nombre_estado as estado,
gr.comentario as recibido_por,
 CONCAT(ar.ip_server,'',ar.ruta_archivo,'',ar.nombre_archivo) nombre_ruta
FROM guia_remision gr
LEFT JOIN estados es on gr.id_estado = es.id_estado
LEFT JOIN archivo ar on gr.id_archivo = ar.id_archivo
where gr.id_guia_remision = id_guia
UNION ALL

SELECT grc.id_guia_remision_cliente as id,
 (case when grc.grs is null then grc.gr else concat(grc.grs,'-',grc.gr) end ) as numero_guia, 
gr.fecha_reg,
grc.descripcion,
'GRC' as tipo,
'GRP' as tipo_tabla,
es.nombre_estado as estado,
grc.recibido_por, 
 CONCAT(ar.ip_server,'',ar.ruta_archivo,'',ar.nombre_archivo) nombre_ruta
FROM guia_remision_cliente grc
LEFT JOIN estados es on grc.id_estado_mercaderia = es.id_estado
LEFT JOIN guia_remision gr on grc.id_guia_remision = gr.id_guia_remision
LEFT JOIN archivo ar on grc.id_archivo = ar.id_archivo
where grc.id_guia_remision = id_guia
and  grc.fecha_del is null
UNION ALL

SELECT 
grv.id_guia_venta as id,
CONCAT(IF(grv.serie is null,'G',grv.serie),'-',IF (grv.numero_guia is null,'G',grv.numero_guia)) as numero_guia,
grv.fecha_reg,
'' as descripcion,
'GV' as tipo,
'GV' as tipo_tabla,
es.nombre_estado as estado,
comentario as recibido_por, 
 CONCAT(ar.ip_server,'',ar.ruta_archivo,'',ar.nombre_archivo) nombre_ruta
FROM guia_venta grv
LEFT JOIN estados es on grv.id_estado = es.id_estado
 
LEFT JOIN archivo ar on grv.id_archivo = ar.id_archivo
where grv.id_guia_venta = id_guia
and  grv.fecha_del is null
) as x
where x.tipo_tabla = tipo_tabla
ORDER BY  x.fecha_reg;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultaSegoCl
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaSegoCl`;
delimiter ;;
CREATE PROCEDURE `consultaSegoCl`(IN idGuia INT)
BEGIN
SELECT
		grm.id_guia_remision_cliente,
		grm.id_guia_remision,
		 (case when grm.grs is null then grm.gr else concat(grm.grs,'-',grm.gr) end ) as gr,
	#	grm.gr,
		grm.ft,
		grm.oc,
		grm.id_tipo_carga,
		tc.nombre AS tipo_carga,
		grm.descripcion,
		em.nombre_estado AS estado_mercaderia,
		ec.nombre_estado AS estado_cargo,
		IFNULL( grm.fecha_hora_entrega, '' ) fecha_hora_entrega,
		IFNULL( grm.hora_entrega, '' ) hora_entrega,
		IFNULL( grm.fecha_cargo, '' ) fecha_cargo,
		IFNULL( grm.obsevacion, '' ) obsevacion,
		IFNULL( grm.fecha_act, '' ) fecha_act,
		IFNULL( grm.recibido_por, '' ) recibido_por,
		CONCAT(IFNULL(ar.ip_server,''),'',IFNULL(ar.ruta_archivo,''),'',IFNULL(ar.nombre_archivo,'')) nombre_ruta
	FROM
		guia_remision_cliente grm
		INNER JOIN tipo_carga tc ON grm.id_tipo_carga = tc.id_tipo_carga
		INNER JOIN estados em ON grm.id_estado_mercaderia = em.id_estado
		INNER JOIN estados ec ON grm.id_estado_cargo = ec.id_estado 
		LEFT JOIN archivo ar ON grm.id_archivo = ar.id_archivo
	WHERE
		grm.fecha_del IS NULL 
		AND grm.id_guia_remision_cliente = idGuia;
		end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultaSeguimiento
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaSeguimiento`;
delimiter ;;
CREATE PROCEDURE `consultaSeguimiento`(IN id_guia INT)
BEGIN
		 
		select 
			gr.id_guia_remision,
			concat(gr.serie,'-',gr.numero_guia) as numero_guia,
			gr.fecha,
			gr.fecha_traslado,
			dpu.nombre_provincia as origen,
			dlu.nombre_provincia as destino,
			e.id_estado,
			     e.nombre_estado,
			r.razon_social as remitente,
			d.razon_social as destinatario,
			dll.direccion as direccion_llegada,
				dp.direccion as direccion_partida,
				v.nombre_via as via,
				gr.comentario,
					ar.ruta_archivo,
	ar.nombre_archivo,
	CONCAT(IFNULL(ar.ip_server,''),'',ar.ruta_archivo,'',ar.nombre_archivo) nombre_ruta,
	ar.id_archivo
				
		from guia_remision gr
		LEFT join direcciones dp on gr.id_direccion_partida = dp.id_direccion
		LEFT join ubigeos dpu on dp.id_ubigeo = dpu.id_ubigeo
		LEFT join direcciones dll on gr.id_direccion_llegada= dll.id_direccion
		LEFT join ubigeos dlu on dll.id_ubigeo = dlu.id_ubigeo
		LEFT join estados e on gr.id_estado = e.id_estado
		LEFT join entidades r on gr.id_remitente = r.id_entidad
		LEFT join entidades d on gr.id_destinatario = d.id_entidad
		LEFT join via v on gr.id_via = v.id_via
		LEFT join archivo ar on gr.id_archivo = ar.id_archivo
		where gr.fecha_del is null and concat(gr.serie,' ',gr.numero_guia,' ',r.razon_social,' ',d.razon_social) and 	gr.id_guia_remision=	 id_guia;
		
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultaSeguimientoCl
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaSeguimientoCl`;
delimiter ;;
CREATE PROCEDURE `consultaSeguimientoCl`(IN id_guia INT)
BEGIN
		  
	
		select 
			gr.id_guia_remision,
			gr.id_cliente,
			concat(gr.serie,'-',gr.numero_guia) as numero_guia,
			gr.fecha,
			gr.fecha_traslado,
			dpu.nombre_provincia as origen,
			dlu.nombre_provincia as destino,
			e.id_estado,
			     e.nombre_estado,
			r.razon_social as remitente,
			d.razon_social as destinatario,
			dll.direccion as direccion_llegada,
				dp.direccion as direccion_partida,
				v.nombre_via as via,
				gr.comentario,
					ar.ip_server,
	ar.nombre_archivo,
		CONCAT(IFNULL(ar.ip_server,''),'',IFNULL(ar.ruta_archivo,''),'',ar.nombre_archivo) nombre_ruta,
	ar.id_archivo,
	trp.razon_social,
	gr.factura_transportista,
	gr.guia_remision_transportista
				
		from guia_remision gr
		LEFT join direcciones dp on gr.id_direccion_partida = dp.id_direccion
		LEFT join ubigeos dpu on dp.id_ubigeo = dpu.id_ubigeo
		LEFT join direcciones dll on gr.id_direccion_llegada= dll.id_direccion
		LEFT join ubigeos dlu on dll.id_ubigeo = dlu.id_ubigeo
		LEFT join estados e on gr.id_estado = e.id_estado
		LEFT join entidades r on gr.id_remitente = r.id_entidad
		LEFT join entidades d on gr.id_destinatario = d.id_entidad
		LEFT join via v on gr.id_via = v.id_via
		LEFT join archivo ar on gr.id_archivo = ar.id_archivo
		LEFT join transportista trp on gr.transportista = trp.id_transportista
		where gr.fecha_del is null and concat(gr.serie,' ',gr.numero_guia,' ',r.razon_social,' ',d.razon_social) and 	gr.id_guia_remision=	 id_guia;
		
		
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultaSeguimientorc
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaSeguimientorc`;
delimiter ;;
CREATE PROCEDURE `consultaSeguimientorc`(IN id_guia INT)
BEGIN
		 
		
		select 
			gr.id_guia_remision_cliente,
			 
					ar.ruta_archivo,
