delimiter ;

-- ----------------------------
-- Procedure structure for consultaSeguimientoV
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultaSeguimientoV`;
delimiter ;;
CREATE PROCEDURE `consultaSeguimientoV`(IN id_guia INT)
BEGIN
select 
	g.fecha,
	concat(g.serie,'-',g.numero_guia) as numero_guia,
	g.fecha as fecha_traslado,
	r.razon_social as remitente,
	r.numero_documento as doc_remitente,
	(SELECT direccion FROM direcciones WHERE id_direccion = 1726 ) as direccion_partida,
	 
	gvd.nombres_destinatario as destinatario,
 	gvd.numero_documento as doc_destinatario,
  
	concat(p.nombres,' ',p.apellido_paterno,' ',p.apellido_materno) as conductor,
	e.licencia,
	vm.nombre_marca as marca,
	gvd.observacion,
	v.placa,
	dgv.peso,
	dgv.cantidad,
	if( ag.cuenta is null, gvd.direccion_destinatario,ag.cuenta ) as direccion_llegada,
	va.nombre_via as via ,
	es.id_estado,
	g.comentario,
	esv.id_estado_venta,
	ar.ruta_archivo,
	ar.nombre_archivo,
	CONCAT(ar.ruta_archivo,'',ar.nombre_archivo) nombre_ruta,
	ar.id_archivo,
	CONCAT(vf.tipo_comprobante,'-',vf.serie, '-', vf.correlativo ) as factura_boleta, 
	g.fecha_entrega
	 
	
	
from guia_venta g
LEFT join clientes_ventas r on g.id_entidad_ = r.id_entidad
LEFT join empleados e on g.id_conductor = e.id_empleado
LEFT JOIN  guia_venta_destino gvd on g.id_guia_venta = gvd.id_guia_remision
LEFT join detalle_guia_venta dgv on g.id_guia_venta = dgv.id_guia_venta
LEFT join personas p on e.id_persona = p.id_persona
LEFT join vehiculos v on g.id_vehiculo = v.id_vehiculo
LEFT join marca_vehiculo vm on v.id_marca = vm.id_marca
LEFT join direcciones dr on r.id_entidad = dr.id_entidad
LEFT JOIN  agente ag on gvd.id_agente = ag.id_agente
LEFT JOIN via va on dgv.id_forma_envio = va.id_via
LEFT join estados es on g.id_estado = es.id_estado
LEFT join estados_venta esv on g.id_estados_venta = esv.id_estado_venta
LEFT join archivo ar on g.id_archivo = ar.id_archivo
		LEFT JOIN ventas_factura vf on g.id_guia_venta = vf.id_guia_ventas


where g.id_guia_venta = id_guia;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for DatosCorreo
-- ----------------------------
DROP PROCEDURE IF EXISTS `DatosCorreo`;
delimiter ;;
CREATE PROCEDURE `DatosCorreo`(IN numero_guia VARCHAR(100))
BEGIN
SELECT 
gr.nm_solicitud,
CONCAT(gr.serie,'-',gr.numero_guia) as numero_guia,
en.razon_social as cliente, 
en.correo, 
rem.razon_social as remitente, 
CONCAT(grc.grs,'-',grc.gr) as guia_cliente,
de.direccion as direccion_envio,
dll.direccion as direccion_llegada,
CONCAT(ube.nombre_departamento,'-',ube.nombre_distrito) as origen,
CONCAT(ubll.nombre_departamento,'-',ubll.nombre_distrito)  as destino

FROM guia_remision gr
inner join entidades en on gr.id_cliente = en.id_entidad
inner join entidades rem on gr.id_remitente = rem.id_entidad
inner join direcciones de on gr.id_direccion_partida = de.id_direccion
inner join direcciones dll on gr.id_direccion_llegada = dll.id_direccion
inner join ubigeos ube on de.id_ubigeo = ube.id_ubigeo
inner join ubigeos ubll on dll.id_ubigeo = ubll.id_ubigeo
LEFT JOIN guia_remision_cliente grc on gr.id_guia_remision = grc.id_guia_remision

WHERE gr.fecha_del is null and grc.fecha_del is null
and grc.gr is not null 
and trim(CONCAT(gr.serie,'-',gr.numero_guia)) = numero_guia
ORDER BY gr.id_guia_remision DESC;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for DatosCorreoGuiaP
-- ----------------------------
DROP PROCEDURE IF EXISTS `DatosCorreoGuiaP`;
delimiter ;;
CREATE PROCEDURE `DatosCorreoGuiaP`(IN numero_solicitud VARCHAR(100))
BEGIN
SELECT 
gr.nm_solicitud,
CONCAT(gr.serie,'-',gr.numero_guia) as numero_guia,
en.razon_social as cliente, 
en.correo, 
rem.razon_social as remitente, 
 
de.direccion as direccion_envio,
dll.direccion as direccion_llegada,
CONCAT(ube.nombre_departamento,'-',ube.nombre_distrito) as origen,
CONCAT(ubll.nombre_departamento,'-',ubll.nombre_distrito)  as destino,
dgr.peso

FROM guia_remision gr
inner join entidades en on gr.id_cliente = en.id_entidad
inner join entidades rem on gr.id_remitente = rem.id_entidad
inner join direcciones de on gr.id_direccion_partida = de.id_direccion
inner join direcciones dll on gr.id_direccion_llegada = dll.id_direccion
inner join ubigeos ube on de.id_ubigeo = ube.id_ubigeo
inner join ubigeos ubll on dll.id_ubigeo = ubll.id_ubigeo
inner JOIN detalle_guia_remitente dgr on gr.id_guia_remision = dgr.id_guia_remision
WHERE gr.fecha_del is null  
and trim(nm_solicitud) = numero_solicitud
ORDER BY gr.id_guia_remision DESC;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for datoUsuario
-- ----------------------------
DROP PROCEDURE IF EXISTS `datoUsuario`;
delimiter ;;
CREATE PROCEDURE `datoUsuario`(IN idUsuario int)
begin
	select 
		pe.nombre_perfil as perfil,
		concat(p.nombres,' ',p.apellido_paterno,' ',p.apellido_materno) as persona
	from usuarios u
		inner join personas p on u.id_persona = p.id_persona
		inner join perfiles pe on u.id_perfil = pe.id_perfil
  where u.fecha_del is null and u.id_usuario = idUsuario;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for detalleGuia
-- ----------------------------
DROP PROCEDURE IF EXISTS `detalleGuia`;
delimiter ;;
CREATE PROCEDURE `detalleGuia`(IN idGuia int)
begin
	select 
		g.id_detalle_guia,
		p.id_producto,
		p.cod_producto as producto,
		p.nombre_producto as descripcion,
		p.unidad_medida,
		g.cantidad,
		g.peso,
		g.volumen
	from detalle_guia_remitente g
	inner join productos p on g.id_producto = p.id_producto
	where g.fecha_del is null and g.id_guia_remision = idGuia;
end
;;
