-- ----------------------------
-- Procedure structure for EntidadesTarifa
-- ----------------------------
DROP PROCEDURE IF EXISTS `EntidadesTarifa`;
delimiter ;;
CREATE PROCEDURE `EntidadesTarifa`(IN id_tarifa INT)
BEGIN
select 
 te.id_tarifa,
 te.id_entidad,
 en.razon_social,
 en.numero_documento,
 te.tarifa_m_t_costo,
 te.tarifa_m_t_igv,
 te.tarifa_m_t_total,
 
 te.tarifa_m_t_costo_ref,
 te.tarifa_m_t_igv_ref,
 te.tarifa_m_t_total_ref,
 
 te.tarifa_m_t_c_pel,
 te.tarifa_m_t_igv_pel,
 te.tarifa_m_t_total_pel,
 
 te.tarifa_m_a_c,
 te.tarifa_m_a_total,
 te.tarifa_m_a_igv,
 
 te.tarifa_m_a_c_ref,
 te.tarifa_m_a_igv_ref,
 te.tarifa_m_a_total_ref,
 
 te.tarifa_m_a_c_pel,
 te.tarifa_m_a_igv_pel,
 te.tarifa_m_a_total_pel,
 
 COUNT(*) as total
from tarifa_entidad te 
inner join entidades en on te.id_entidad = en.id_entidad
	
 where te.fecha_del is null and te.id_tarifa=id_tarifa 
 GROUP BY en.razon_social	
