-- ----------------------------
-- Procedure structure for ExportarTotalFactura
-- ----------------------------
DROP PROCEDURE IF EXISTS `ExportarTotalFactura`;
delimiter ;;
CREATE PROCEDURE `ExportarTotalFactura`()
BEGIN
	SELECT
	vf.id_ventas_factura,
	vf.cliente,
	 vf.numero_documento,
	 vf.cantidad,
	 vf.producto,
	 vf.total,
	 vf.subtotal,
	 vf.igv,
	 vf.forma_pago,
	 vf.tipo_comprobante,
	 vf.fecha_reg,
	 usu.usuario,
	 CONCAT(serie,'-',correlativo) as documento
	 
	FROM
		ventas_factura vf
		inner join usuarios usu on usu.id_usuario = vf.id_usuario_reg
	WHERE
