-- ----------------------------
-- Procedure structure for guiaCliente
-- ----------------------------
DROP PROCEDURE IF EXISTS `guiaCliente`;
delimiter ;;
CREATE PROCEDURE `guiaCliente`(IN idGuia INT)
BEGIN
select
	grm.id_guia_remision_cliente,
	if(grm.grs is null,'', grm.grs) as grs,	
	(case when grm.grs is null then grm.gr else concat(grm.grs,'-',grm.gr) end ) as guia_cliente,
	grm.gr,
	grm.ft,
	grm.oc,
	grm.id_tipo_carga,
	tc.nombre as tipo_carga,
	grm.descripcion
from guia_remision_cliente grm
inner join tipo_carga tc on grm.id_tipo_carga = tc.id_tipo_carga
WHERE grm.fecha_del is null and grm.id_guia_remision = idGuia;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for guiaClienteSeg
-- ----------------------------
DROP PROCEDURE IF EXISTS `guiaClienteSeg`;
delimiter ;;
CREATE PROCEDURE `guiaClienteSeg`(IN idGuia INT)
BEGIN
	SELECT
		grm.id_guia_remision_cliente,
		grm.id_guia_remision,
		 (case when grs is null then gr else concat(grs,'-',gr) end ) as gr,
	#	grm.gr,
		grm.ft,
		grm.oc,
		grm.id_tipo_carga,
		tc.nombre AS tipo_carga,
		grm.descripcion,
		em.nombre_estado AS estado_mercaderia,
		ec.nombre_estado AS estado_cargo,
		IFNULL( grm.fecha_hora_entrega, '' ) fecha_hora_entrega,
		IFNULL( grm.hora_entrega, '' ) hora_entrega,
		IFNULL( grm.fecha_cargo, '' ) fecha_cargo,
		IFNULL( grm.obsevacion, '' ) obsevacion,
		IFNULL( grm.fecha_act, '' ) fecha_act,
		IFNULL( grm.recibido_por, '' ) recibido_por 
	FROM
		guia_remision_cliente grm
		INNER JOIN tipo_carga tc ON grm.id_tipo_carga = tc.id_tipo_carga
		INNER JOIN estados em ON grm.id_estado_mercaderia = em.id_estado
		INNER JOIN estados ec ON grm.id_estado_cargo = ec.id_estado 
	WHERE
		grm.fecha_del IS NULL 
		AND grm.id_guia_remision = idGuia;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for Guias_remision_cliente
-- ----------------------------
DROP PROCEDURE IF EXISTS `Guias_remision_cliente`;
delimiter ;;
CREATE PROCEDURE `Guias_remision_cliente`(IN id_guia_remision INT)
BEGIN
SELECT gr.id_guia_remision as id,
CONCAT(IF(gr.serie is null,'G',gr.serie),'-',IF (gr.numero_guia is null,'G',gr.numero_guia)) as numero_guia
FROM guia_remision gr
where gr.id_guia_remision = 519 
UNION ALL
SELECT grc.id_guia_remision_cliente as id,
CONCAT(IF(grc.grs is null,'G',grc.grs),'-',IF (grc.gr is null,'G',grc.gr)) as numero_guia
FROM guia_remision_cliente grc
LEFT JOIN guia_remision_cliente gr on grc.id_guia_remision = gr.id_guia_remision
where gr.id_guia_remision = 519 ;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for imprimirFactura
-- ----------------------------
DROP PROCEDURE IF EXISTS `imprimirFactura`;
delimiter ;;
CREATE PROCEDURE `imprimirFactura`(IN idventafac INT)
BEGIN
	SELECT
	vf.id_ventas_factura,
	vf.cliente,
	 vf.numero_documento,
	 vf.cantidad,
	 vf.producto,
	 vf.total,
	 vf.subtotal,
	 vf.igv,
	 vf.forma_pago,
	 vf.tipo_comprobante,
	 vf.fecha_reg,
	 usu.usuario,
	 CONCAT(serie,'-',correlativo) as documento
	 
	FROM
