-- ----------------------------
-- Procedure structure for imprimirGuiaRotulado
-- ----------------------------
DROP PROCEDURE IF EXISTS `imprimirGuiaRotulado`;
delimiter ;;
CREATE PROCEDURE `imprimirGuiaRotulado`(IN idGuia int,IN idUsuario int)
begin
select 
	g.fecha,
	g.fecha_traslado,
	if (g.numero_guia is null,concat(serie,'-',''),concat(g.serie,'-',g.numero_guia)) as numero_guia,
	r.razon_social as remitente,
	r.numero_documento as doc_remitente,
	ub.nombre_departamento as nd_remitente ,
	d.razon_social as destinatario,
	ubd.nombre_departamento as nd_destino ,
	d.numero_documento as doc_destinatario,
	dr.direccion as direccion_remitente,
	dd.direccion as direccion_destinatario,
	concat(p.nombres,' ',p.apellido_paterno,' ',p.apellido_materno) as conductor,
	e.licencia,
	vm.nombre_marca as marca,
	v.placa,
	pr.nombre_producto,
	dgr.cantidad,
			usu.usuario
	
from guia_remision g
left join entidades r on g.id_remitente = r.id_entidad
left join entidades d on g.id_destinatario = d.id_entidad
left join direcciones dr on g.id_direccion_partida = dr.id_direccion
left join direcciones dd on g.id_direccion_llegada = dd.id_direccion
left join empleados e on g.id_conductor = e.id_empleado
left join personas p on e.id_persona = p.id_persona
left join vehiculos v on g.id_vehiculo = v.id_vehiculo
left join marca_vehiculo vm on v.id_marca = vm.id_marca
left JOIN ubigeos ub ON dr.id_ubigeo = ub.id_ubigeo
left JOIN ubigeos ubd ON dd.id_ubigeo = ubd.id_ubigeo
left JOIN detalle_guia_remitente dgr ON g.id_guia_remision = dgr.id_guia_remision
left JOIN productos pr ON dgr.id_producto = pr.id_producto
left join usuarios usu on idUsuario = usu.id_usuario

where g.id_guia_remision = idGuia;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for imprimirGuiaTransportista
-- ----------------------------
DROP PROCEDURE IF EXISTS `imprimirGuiaTransportista`;
delimiter ;;
CREATE PROCEDURE `imprimirGuiaTransportista`(IN idGuia int)
begin
select 
	g.fecha,
	g.fecha_traslado,
	if (g.numero_guia is null,concat(g.serie,'-',''),concat(g.serie,'-',g.numero_guia)) as numero_guia,
	r.razon_social as remitente,
	r.numero_documento as doc_remitente,
	d.razon_social as destinatario,
	d.numero_documento as doc_destinatario,
	dr.direccion as direccion_remitente,
	dd.direccion as direccion_destinatario,
	concat(p.nombres,' ',p.apellido_paterno,' ',p.apellido_materno) as conductor,
	e.licencia,
	vm.nombre_marca as marca,
	v.incripcion,
	v.config_vehicular,
	
	v.placa
from guia_remision g
inner join entidades r on g.id_remitente = r.id_entidad
inner join entidades d on g.id_destinatario = d.id_entidad
inner join direcciones dr on g.id_direccion_partida = dr.id_direccion
inner join direcciones dd on g.id_direccion_llegada = dd.id_direccion
inner join empleados e on g.id_conductor = e.id_empleado
inner join personas p on e.id_persona = p.id_persona
inner join vehiculos v on g.id_vehiculo = v.id_vehiculo
inner join marca_vehiculo vm on v.id_marca = vm.id_marca
where g.id_guia_remision = idGuia;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for imprimirGuiaVenta
-- ----------------------------
DROP PROCEDURE IF EXISTS `imprimirGuiaVenta`;
delimiter ;;
CREATE PROCEDURE `imprimirGuiaVenta`(IN idGuia int)
begin
select 
	g.fecha,
	g.fecha as fecha_traslado,
	r.razon_social as remitente,
	r.numero_documento as doc_remitente,
	(SELECT direccion FROM direcciones WHERE id_direccion = 1726 ) as direccion_remitente,
	 
	CONCAT(gvd.nombres_destinatario,' ' ,gvd.apellidos_destinatario) as destinatario,
 	gvd.numero_documento as doc_destinatario,
  
	concat(p.nombres,' ',p.apellido_paterno,' ',p.apellido_materno) as conductor,
	e.licencia,
	vm.nombre_marca as marca,
	gvd.observacion,
	v.placa,
	dgv.peso,
	g.guia_cliente,
	dgv.cantidad ,
	if( ag.cuenta is null, gvd.direccion_destinatario,ag.cuenta ) as direccion_destinatario1,

	if( gvd.id_tipo_entrega=1,if( ag.agente is null, CONCAT(ub.nombre_provincia,'-',ub.nombre_distrito),ag.agente ),
if( gvd.id_tipo_entrega=2, gvd.direccion_destinatario,ag.agente )	) as direccion_destinatario
	
from guia_venta g
LEFT join clientes_ventas r on g.id_entidad_ = r.id_entidad
LEFT join empleados e on g.id_conductor = e.id_empleado
LEFT JOIN guia_venta_destino gvd on g.id_guia_venta = gvd.id_guia_remision
LEFT join detalle_guia_venta dgv on g.id_guia_venta = dgv.id_guia_venta
LEFT join personas p on e.id_persona = p.id_persona
LEFT JOIN vehiculos v on g.id_vehiculo = v.id_vehiculo
LEFT JOIN marca_vehiculo vm on v.id_marca = vm.id_marca
LEFT JOIN agente ag on gvd.id_agente = ag.id_agente
LEFT JOIN ubigeos ub on gvd.id_ubigeo = ub.id_ubigeo
 
where g.id_guia_venta = idGuia;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for imprimirGuiaVRotulado
-- ----------------------------
DROP PROCEDURE IF EXISTS `imprimirGuiaVRotulado`;
delimiter ;;
CREATE PROCEDURE `imprimirGuiaVRotulado`(IN idGuia INT, IN idUsuario INT)
BEGIN
	SELECT
		#ubd.nombre_departamento as nd_destino ,
		concat( g.serie, '-', g.numero_guia ) AS numero_guia,
		g.fecha,
		g.fecha AS fecha_traslado,
		r.razon_social AS remitente,
		r.numero_documento AS doc_remitente,
		( SELECT ubi.nombre_departamento FROM direcciones  drs
		LEFT JOIN ubigeos ubi ON drs.id_ubigeo = ubi.id_ubigeo  WHERE id_direccion = 1726 ) AS        direccion_remitente,
		CONCAT( gvd.nombres_destinatario, ' ', gvd.apellidos_destinatario ) AS destinatario,
		gvd.numero_documento AS doc_destinatario,
		concat( p.nombres, ' ', p.apellido_paterno, ' ', p.apellido_materno ) AS conductor,
		e.licencia,
		vm.nombre_marca AS marca,
		gvd.observacion,
		v.placa,
		dgv.peso,
		g.guia_cliente,
		dgv.cantidad,
		pro.nombre_producto,
 	IF
		(
			gvd.id_tipo_entrega = 1,
		IF
			( ag.cuenta IS NULL, CONCAT( ub.nombre_provincia, '-', ub.nombre_distrito ), ag.cuenta ),
		IF
			( gvd.id_tipo_entrega = 2, ub.nombre_departamento, ag.cuenta ) 
		) AS lugardestino,
		
	IF
		(
			gvd.id_tipo_entrega = 1,
		IF
			( ag.cuenta IS NULL, CONCAT( ub.nombre_provincia, '-', ub.nombre_distrito ), ag.cuenta ),
		IF
			( gvd.id_tipo_entrega = 2, gvd.direccion_destinatario, ag.cuenta ) 
		) AS direccion_destinatario,
			usu.usuario
	FROM
		guia_venta g
		LEFT JOIN clientes_ventas r ON g.id_entidad_ = r.id_entidad
		LEFT JOIN empleados e ON g.id_conductor = e.id_empleado
		LEFT JOIN guia_venta_destino gvd ON g.id_guia_venta = gvd.id_guia_remision
		LEFT JOIN detalle_guia_venta dgv ON g.id_guia_venta = dgv.id_guia_venta
		LEFT JOIN personas p ON e.id_persona = p.id_persona
		LEFT JOIN vehiculos v ON g.id_vehiculo = v.id_vehiculo
		LEFT JOIN marca_vehiculo vm ON v.id_marca = vm.id_marca
		LEFT JOIN agente ag ON gvd.id_agente = ag.id_agente
		LEFT JOIN ubigeos ub ON gvd.id_ubigeo = ub.id_ubigeo
		LEFT JOIN usuarios usu ON idUsuario = usu.id_usuario 
		LEFT JOIN productos pro on dgv.id_producto = pro.id_producto
	WHERE
		g.id_guia_venta = idGuia;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listaAtePedidos
-- ----------------------------
DROP PROCEDURE IF EXISTS `listaAtePedidos`;
delimiter ;;
CREATE PROCEDURE `listaAtePedidos`(IN id_pedido_cliente int)
begin
select
ap.id_atencion_pedidos,
ap.conductor,
ap.unidad
from atencion_pedidos ap
LEFT JOIN vehiculos vh on ap.unidad = vh.id_vehiculo
where ap.id_pedido_cliente = id_pedido_cliente;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listadoAgente
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoAgente`;
delimiter ;;
CREATE PROCEDURE `listadoAgente`(IN row1 INT,IN length1 INT,IN busca varchar(200))
BEGIN
	select 
		id_agente,
		cuenta,
		agente,
	 
		(select count(*) from agente where fecha_del is null) as total
	from agente
  where fecha_del is null and concat(cuenta,' ',agente) like concat('%',busca,'%') ORDER BY id_agente DESC
		LIMIT row1,length1;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listadoateAuxPedidos
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoateAuxPedidos`;
delimiter ;;
CREATE PROCEDURE `listadoateAuxPedidos`(IN row1 INT, IN length1 INT, IN busca VARCHAR ( 200 ), IN auxiliar INT, OUT total INT)
BEGIN
	DECLARE
		totalRegistro INT;
SELECT
	pc.nm_solicitud,
	pc.fecha,
	pc.hora_recojo,
	pc.contacto,
	pc.telefono,
	ap.id_atencion_pedidos,
	ap.conductor,
	ap.auxiliar,
	ap.unidad,
	ep.id_empleado,
	pe.nombres,
	usu.id_usuario,
	en.razon_social,
	es.nombre_estado
	
FROM
	atencion_pedidos ap
	LEFT JOIN vehiculos vh ON ap.unidad = vh.id_vehiculo
	LEFT JOIN empleados ep ON ap.auxiliar = ep.id_empleado
	LEFT JOIN personas pe ON ep.id_persona = pe.id_persona
	LEFT JOIN usuarios usu ON pe.id_persona = usu.id_persona
	LEFT JOIN pedido_cliente pc ON ap.id_pedido_cliente = pc.id_pedido_cliente
  Inner JOIN entidades en on pc.id_cliente = en.id_entidad	
	 LEFT JOIN estados es on ap.estado = es.id_estado
WHERE
	ap.fecha_del IS NULL and pc.fecha_del is null
	AND usu.id_usuario =  auxiliar
		AND concat( ap.conductor, ' ', ap.conductor, ' ', ap.conductor ) LIKE concat( '%', busca, '%' ) 
	ORDER BY
		ap.fecha_reg DESC 
		LIMIT row1,
		length1;
	
	SET totalRegistro = (
		SELECT
			COUNT( * ) 
		FROM
			atencion_pedidos ap
			LEFT JOIN vehiculos vh ON ap.unidad = vh.id_vehiculo
  LEFT JOIN empleados ep ON ap.auxiliar = ep.id_empleado
	LEFT JOIN personas pe ON ep.id_persona = pe.id_persona
	left join usuarios usu on pe.id_persona = usu.id_persona
		WHERE
			ap.fecha_del IS NULL 
			AND usu.id_usuario = auxiliar 
			AND concat( ap.conductor, ' ', ap.conductor, ' ', ap.conductor ) LIKE concat( '%', busca, '%' ) 
		);
	SELECT
		totalRegistro INTO total;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listadoBoletas
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoBoletas`;
delimiter ;;
CREATE PROCEDURE `listadoBoletas`(IN row1 INT, IN length1 INT, IN busca VARCHAR ( 200 ))
BEGIN
	SELECT
		vf.id_ventas_factura,
		vf.serie,
		vf.correlativo,
		vf.tipo_comprobante,
		vf.cliente,
		vf.numero_documento,
		vf.total AS total_m,
		vf.fecha_reg,
		ef.descripcion AS estado,
		ef.codigo AS estado_codigo,
		vf.total AS total_monto,
		CONCAT( gv.serie, '-', gv.numero_guia ) AS guia_venta,
(select count(*) from ventas_factura vh where vh.fecha_del is null AND vh.tipo_comprobante = 'Boleta' ) as total
	FROM
		ventas_factura vf
		LEFT JOIN estados_factura ef ON vf.estado = ef.id_estado_factura
		INNER JOIN guia_venta gv ON vf.id_guia_ventas = gv.id_guia_venta 
	WHERE
		vf.fecha_del IS NULL 
		AND vf.tipo_comprobante = 'Boleta' 
 
		AND concat(
			CONCAT( gv.serie, '-', gv.numero_guia ),
			' ',
			gv.numero_guia,
			' ',
			vf.cliente,
			' ',
			vf.serie,
			' ',
			vf.correlativo,
			' ' 
		) LIKE concat( '%', busca, '%' ) 
	ORDER BY
		id_ventas_factura DESC 
		LIMIT row1,
		length1;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listadoClientesVentas
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoClientesVentas`;
delimiter ;;
CREATE PROCEDURE `listadoClientesVentas`(IN row1 INT,IN length1 INT,IN busca varchar(200))
BEGIN
	select 	
	e.id_entidad,
	te.descripcion,
  u.documento,	
  e.numero_documento,
  e.razon_social,
  e.telefono, 
  e.correo,
(select count(*) from clientes_ventas where fecha_del is null) as total
	from clientes_ventas e
	inner join tipo_entidad te on e.id_tipo_entidad = te.id_tipo_entidad
	inner join tipo_documentos u on e.id_tipo_documento = u.id_tipo_documento
  where e.fecha_del is null and concat(e.razon_social,' ',u.documento,' ',e.numero_documento,' ',e.razon_social,' ',e.telefono,' ',e.correo) like concat('%',busca,'%') ORDER BY id_entidad DESC
