CREATE PROCEDURE `listadoFacturas`(IN row1 INT,IN length1 INT,IN busca varchar(200))
BEGIN
	select 
	vf.id_ventas_factura,
	vf.serie,
	vf.correlativo,
	vf.tipo_comprobante,
	vf.cliente,
	vf.numero_documento,
	vf.total as total_m,
	vf.fecha_reg, 
  ef.descripcion as estado,
	ef.codigo as estado_codigo,
 vf.total as total_monto,
 CONCAT(gv.serie,'-',gv.numero_guia) as guia_venta,
	(select count(*) from ventas_factura vh where vh.fecha_del is null AND vh.tipo_comprobante = 'Factura' ) as total
	from ventas_factura vf
	LEFT JOIN estados_factura ef on vf.estado = ef.id_estado_factura
	inner JOIN guia_venta gv on vf.id_guia_ventas = gv.id_guia_venta
  where vf.fecha_del is null AND vf.tipo_comprobante = 'Factura'  and concat(CONCAT(gv.serie,'-',gv.numero_guia),' ',gv.numero_guia,' ',vf.cliente,' ',vf.serie,' ',vf.correlativo,' ') like concat('%',busca,'%') ORDER BY id_ventas_factura DESC
		LIMIT row1,length1;
END
