-- ----------------------------
-- Procedure structure for listadoGuiaClSeguimiento
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoGuiaClSeguimiento`;
delimiter ;;
CREATE PROCEDURE `listadoGuiaClSeguimiento`(IN row1 INT, IN length1 INT, IN busca VARCHAR ( 200 ), IN usuario_session INT ,OUT total INT)
BEGIN
DECLARE totalRegistro INT;
SELECT
	gr.nm_solicitud,
	concat( gr.serie, '-', gr.numero_guia ) AS numero_guia,
	grc.gr,
	d.razon_social,
	dgr.id_entidad,
	usu.id_persona,
	gr.id_guia_remision,
		dlu.nombre_provincia as destaino,
		e.nombre_estado, 
		HOUR(gr.fecha_reg) as horarecepcion
		 
FROM
	guia_remision gr
	LEFT JOIN guia_remision_cliente grc ON gr.id_guia_remision = grc.id_guia_remision
	LEFT JOIN entidades d ON gr.id_destinatario = d.id_entidad
	LEFT JOIN entidades dgr ON gr.id_cliente = dgr.id_entidad
	LEFT JOIN personas pers ON dgr.id_entidad = pers.id_entidad
	LEFT JOIN usuarios usu ON pers.id_persona = usu.id_persona
	inner join direcciones dl on gr.id_direccion_llegada= dl.id_direccion
	inner join ubigeos dlu on dl.id_ubigeo = dlu.id_ubigeo
	inner join estados e on grc.id_estado_mercaderia = e.id_estado
WHERE
	gr.fecha_del IS NULL 
	AND usu.id_usuario = usuario_session 
	AND concat( gr.serie, ' ', gr.numero_guia ) LIKE concat( '%', busca, '%' ) 
ORDER BY gr.fecha_reg DESC	
	LIMIT row1,
	length1;

SET totalRegistro = (
	SELECT
		count( gr.id_guia_remision ) 
	FROM
	    guia_remision gr
		LEFT JOIN guia_remision_cliente grc ON gr.id_guia_remision = grc.id_guia_remision
		LEFT JOIN entidades d ON gr.id_destinatario = d.id_entidad
		LEFT JOIN entidades dgr ON gr.id_cliente = dgr.id_entidad
		LEFT JOIN personas pers ON dgr.id_entidad = pers.id_entidad
		LEFT JOIN usuarios usu ON pers.id_persona = usu.id_persona 
	WHERE
		gr.fecha_del IS NULL 
		AND usu.id_usuario = usuario_session 
		AND concat( gr.serie, ' ', gr.numero_guia ) LIKE concat( '%', busca, '%' ) 
	);
SELECT
	totalRegistro INTO total;

END
;;
delimiter ;

