DROP PROCEDURE IF EXISTS `listadoGuiaRemision`;
delimiter ;;
CREATE PROCEDURE `listadoGuiaRemision`(IN row1 INT,IN length1 INT,IN busca varchar(200),OUT total int)
BEGIN
		declare totalRegistro int;
		
		select 
			gr.id_guia_remision,
			gr.nm_solicitud,
		 en.razon_social as cliente,
	   if (gr.numero_guia is null,concat(serie,'-',''),concat(gr.serie,'-',gr.numero_guia)) as numero_guia,
			gr.fecha,
			gr.fecha_traslado,
			dpu.nombre_provincia as origen,
			dlu.nombre_provincia as destino,
			e.nombre_estado,
			
			r.razon_social as remitente,
			d.razon_social as destinatario,
			usu.usuario
		from guia_remision gr
		inner join direcciones dp on gr.id_direccion_partida = dp.id_direccion
		inner join ubigeos dpu on dp.id_ubigeo = dpu.id_ubigeo
		inner join direcciones dl on gr.id_direccion_llegada= dl.id_direccion
		inner join ubigeos dlu on dl.id_ubigeo = dlu.id_ubigeo
		inner join estados e on gr.id_estado = e.id_estado
		inner join entidades r on gr.id_remitente = r.id_entidad
		inner join entidades d on gr.id_destinatario = d.id_entidad
		inner join entidades en on gr.id_cliente = en.id_entidad
			left JOIN usuarios usu on gr.id_usuario_reg = usu.id_usuario
		where gr.fecha_del is null and concat(gr.serie,' ',gr.numero_guia,' ',r.razon_social,' ',d.razon_social) like concat('%',busca,'%')
		ORDER BY gr.fecha_reg DESC	
		LIMIT row1,length1;
		
		
		set totalRegistro =  (select 
			count(gr.id_guia_remision)
		from guia_remision gr
		inner join direcciones dp on gr.id_direccion_partida = dp.id_direccion
		inner join ubigeos dpu on dp.id_ubigeo = dpu.id_ubigeo
		inner join direcciones dl on gr.id_direccion_llegada= dl.id_direccion
		inner join ubigeos dlu on dl.id_ubigeo = dlu.id_ubigeo
		inner join estados e on gr.id_estado = e.id_estado
		inner join entidades r on gr.id_remitente = r.id_entidad
		inner join entidades d on gr.id_destinatario = d.id_entidad
		where gr.fecha_del is null and concat(gr.numero_guia,' ',r.razon_social,' ',d.razon_social) like concat('%',busca,'%'));
		
		
		select totalRegistro INTO total;
		
END
;;
