-- ----------------------------
-- Procedure structure for listadoGuiaSeguimientoC
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoGuiaSeguimientoC`;
delimiter ;;
CREATE PROCEDURE `listadoGuiaSeguimientoC`(IN row1 INT, IN length1 INT, IN busca VARCHAR ( 200 ), IN usuario_session INT, OUT total INT)
BEGIN
	DECLARE
		totalRegistro INT;
	SELECT
		gr.id_guia_remision,
		gr.nm_solicitud,
		gr.fecha_reg,
		concat( gr.serie, '-', gr.numero_guia ) AS numero_guia,
		d.razon_social as destinatario,
		dgre.razon_social as remitente,
		dgr.id_entidad,
		usu.id_persona,
		CONCAT(dlu.nombre_provincia,'-',dlu.nombre_distrito) AS destino,
		es.nombre_estado
	FROM
		guia_remision gr
		LEFT JOIN entidades d ON gr.id_destinatario = d.id_entidad
		LEFT JOIN entidades dgr ON gr.id_cliente = dgr.id_entidad
		LEFT JOIN entidades dgre ON gr.id_remitente = dgre.id_entidad
		LEFT JOIN personas pers ON dgr.id_entidad = pers.id_entidad
		LEFT JOIN usuarios usu ON pers.id_persona = usu.id_persona
		INNER JOIN direcciones dl ON gr.id_direccion_llegada = dl.id_direccion
		INNER JOIN ubigeos dlu ON dl.id_ubigeo = dlu.id_ubigeo 
		INNER JOIN estados es ON gr.id_estado = es.id_estado
	WHERE
		gr.fecha_del IS NULL 
		AND usu.id_usuario = usuario_session 
		AND concat( gr.serie, ' ', gr.numero_guia ) LIKE concat( '%', busca, '%' ) 
	ORDER BY
		gr.fecha_reg DESC 
		LIMIT row1,
		length1;
	
	SET totalRegistro = (
		SELECT
			count( gr.id_guia_remision ) 
		FROM
			guia_remision gr
			LEFT JOIN entidades d ON gr.id_destinatario = d.id_entidad
			LEFT JOIN entidades dgr ON gr.id_cliente = dgr.id_entidad
			LEFT JOIN personas pers ON dgr.id_entidad = pers.id_entidad
			LEFT JOIN usuarios usu ON pers.id_persona = usu.id_persona
			INNER JOIN direcciones dl ON gr.id_direccion_llegada = dl.id_direccion
			INNER JOIN ubigeos dlu ON dl.id_ubigeo = dlu.id_ubigeo 
		WHERE
			gr.fecha_del IS NULL 
			AND usu.id_usuario = usuario_session 
			AND concat( gr.serie, ' ', gr.numero_guia ) LIKE concat( '%', busca, '%' ) 
		);
	SELECT
		totalRegistro INTO total;

END
;;
