DROP PROCEDURE IF EXISTS `listadoGuiaVenta`;
delimiter ;;
CREATE PROCEDURE `listadoGuiaVenta`(IN row1 INT,IN length1 INT,IN busca varchar(200),OUT total int)
BEGIN
		declare totalRegistro int;
		
		select 
			gr.id_guia_venta,
			concat(gr.serie,'-',gr.numero_guia) as numero_guia,
			gr.fecha,
		 fp.forma_pago,
		 	e.nombre_estado,
			te.descripcion as tipo_entrega,
			esv.nombre_estado as estado_venta,
			gr.flg_factura,
				if( gvd.id_tipo_entrega=1,if( ag.cuenta is null, CONCAT(ub.nombre_provincia,'-',ub.nombre_distrito),ag.cuenta ),
if( gvd.id_tipo_entrega=2, CONCAT(ub.nombre_provincia,'-',ub.nombre_distrito),ag.cuenta )	) as destino
	 
		from guia_venta gr
		inner join forma_pago fp on gr.id_forma_pago = fp.id_forma_pago
		inner join tipo_comprobante tc on gr.id_tipo_comprobante = tc.id_tipo_comprobante 
	 	inner join estados e on gr.id_estado = e.id_estado
		inner join guia_venta_destino gvd on gr.id_guia_venta = gvd.id_guia_remision		inner join tipo_entrega te on gvd.id_tipo_entrega = te.id_tipo_entrega
		LEFT JOIN estados_venta esv ON gr.id_estados_venta = esv.id_estado_venta
		 LEFT JOIN agente ag on gvd.id_agente = ag.id_agente
		LEFT JOIN ubigeos ub on gvd.id_ubigeo = ub.id_ubigeo
		where gr.fecha_del is null and concat(gr.numero_guia,' ',gr.fecha,' ',fp.forma_pago) like concat('%',busca,'%')
    ORDER BY gr.id_guia_venta DESC	
	  LIMIT row1,length1;
		
		
		set totalRegistro =  (select 
			count(gr.id_guia_venta)
		from guia_venta gr
	  inner join forma_pago fp on gr.id_forma_pago = fp.id_forma_pago
		inner join tipo_comprobante tc on gr.id_tipo_comprobante = tc.id_tipo_comprobante 
	 	inner join estados e on gr.id_estado = e.id_estado
		inner join guia_venta_destino gvd on gr.id_guia_venta = gvd.id_guia_remision
		inner join tipo_entrega te on gvd.id_tipo_entrega = te.id_tipo_entrega
	  LEFT JOIN agente ag on gvd.id_agente = ag.id_agente
		LEFT JOIN ubigeos ub on gvd.id_ubigeo = ub.id_ubigeo	
		where gr.fecha_del is null and concat(gr.numero_guia,' ',gr.fecha,' ',fp.forma_pago) like concat('%',busca,'%'));
		
		
		select totalRegistro INTO total;
		
END
;;
delimiter ;

