-- ----------------------------
-- Procedure structure for listadoNotasCredito
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoNotasCredito`;
delimiter ;;
CREATE PROCEDURE `listadoNotasCredito`(IN row1 INT, IN length1 INT, IN busca VARCHAR ( 200 ))
BEGIN
	SELECT
		vf.id_notas_credito,
		vf.serie,
		vf.correlativo,
	  vf.documento_electronico_aplicar,
		vf.fecha_emision,
		vf.motivo_n_credito,
		 ef.descripcion as estado,
	 
		( SELECT count( * ) FROM notas_credito WHERE fecha_del  IS NULL ) AS total 
	FROM
		notas_credito vf
		LEFT JOIN estados_factura ef ON vf.estado = ef.id_estado_factura
		 
	 
	WHERE
		vf.fecha_del   IS NULL 
		 
 
		AND concat(
		  
	 
			vf.correlativo,
			' ' 
		) LIKE concat( '%', busca, '%' ) 
	ORDER BY
		id_notas_credito DESC 
		LIMIT row1,
		length1;

END
;;
