-- ----------------------------
-- Procedure structure for listadoPedido
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoPedido`;
delimiter ;;
CREATE PROCEDURE `listadoPedido`(IN row1 INT, IN length1 INT, IN busca VARCHAR ( 200 ), IN usuario_session int,out total INT)
BEGIN

	declare totalRegistro int;
	SELECT
	pc.nm_solicitud,
		pc.id_pedido_cliente,
		pc.fecha,
		pc.hora_recojo,
		pc.tipo_servicio,
		ts.nombre_producto as tipo_servicios,
		es.nombre_estado,
		pc.id_cliente,
		en.id_entidad,
		pe.id_entidad,
		us.id_persona,
		us.id_usuario
	FROM pedido_cliente pc 
	 	inner join productos ts on pc.tipo_servicio = ts.id_producto
		INNER JOIN estados es on pc.id_estado = es.id_estado
		inner join entidades en on pc.id_cliente = en.id_entidad
		INNER JOIN personas pe on pe.id_entidad = en.id_entidad
	 INNER JOIN usuarios us on pe.id_persona = us.id_persona
	WHERE pc.fecha_del IS NULL 	AND 	us.id_usuario =  usuario_session 
		AND concat(pc.fecha,' ', 	pc.hora_recojo,' ',pc.tipo_servicio ) LIKE concat( '%', busca, '%' ) 	
	ORDER BY pc.fecha_reg DESC  	
	LIMIT row1,	length1;
		
		SET totalRegistro = (SELECT 
														COUNT(*) 
												 FROM pedido_cliente pc 
									inner join productos ts on pc.tipo_servicio = ts.id_producto
		INNER JOIN estados es on pc.id_estado = es.id_estado
		inner join entidades en on pc.id_cliente = en.id_entidad
		INNER JOIN personas pe on pe.id_entidad = en.id_entidad
	 INNER JOIN usuarios us on pe.id_persona = us.id_persona
													WHERE pc.fecha_del IS NULL 	AND 	us.id_usuario =  usuario_session 
													AND concat(pc.fecha,' ', 	pc.hora_recojo,' ',pc.tipo_servicio ) LIKE concat( '%', busca, '%' ));

			select totalRegistro INTO total;
		
	END
;;
delimiter ;

