-- ----------------------------
-- Procedure structure for listadoProvinciaTarifa
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoProvinciaTarifa`;
delimiter ;;
CREATE PROCEDURE `listadoProvinciaTarifa`(IN row1 INT,IN length1 INT,IN busca varchar(200), IN entidad INT)
BEGIN
	select 	

tpe.id_tarifa_provincia_ent,
CONCAT(ub.nombre_provincia, ' - ',ub.nombre_distrito) nombre_provincia,
en.razon_social,
tpe.tarifa_m_a_cg,
tpe.tarifa_m_a_vr,
tpe.tarifa_m_a_pd,
tpe.tarifa_m_a_dm,
(select count(*) from tarifa_provincia_ent where fecha_del is null and  tarifa_m_a_vr is not null) as total
	from tarifa_provincia_ent tpe
	
	inner join ubigeos ub on tpe.id_provincia = ub.id_ubigeo	
	INNER JOIN entidades en on tpe.id_tarifa_entidad=en.id_entidad
 
	 
  where tpe.fecha_del is null 
	and tpe.tarifa_m_a_vr is not null
	and tpe.id_tarifa_entidad=entidad and
	concat(ub.nombre_provincia,' ', ub.nombre_distrito) like concat('%',busca,'%') 
	COLLATE utf8_unicode_ci ORDER BY tpe.id_tarifa_provincia_ent DESC
		LIMIT row1,length1;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listadoProvinciaTarifaT
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoProvinciaTarifaT`;
delimiter ;;
CREATE PROCEDURE `listadoProvinciaTarifaT`(IN row1 INT, IN length1 INT, IN busca VARCHAR ( 200 ), IN entidad INT)
BEGIN
	SELECT
		tpe.id_tarifa_provincia_ent,
		CONCAT(ub.nombre_provincia, ' - ',ub.nombre_distrito) nombre_provincia,
		en.razon_social,
		tarifa_m_t_cg,
		tarifa_m_t_ref,
		tarifa_m_t_vol,
		tarifa_m_t_dm,
		( SELECT count( * ) FROM tarifa_provincia_ent WHERE fecha_del IS NULL and tarifa_m_t_ref is not null ) AS total 
	FROM
		tarifa_provincia_ent tpe
		INNER JOIN ubigeos ub ON tpe.id_provincia = ub.id_ubigeo
		INNER JOIN entidades en ON tpe.id_tarifa_entidad = en.id_entidad 
	WHERE
		tpe.fecha_del IS NULL and
		tpe.tarifa_m_t_ref is not null
	 
		AND tpe.id_tarifa_entidad = entidad
		AND concat( ub.nombre_provincia, ' ' ) LIKE concat( '%', busca, '%' ) 
	ORDER BY
		tpe.id_tarifa_provincia_ent DESC 
		LIMIT row1,
		length1;

END
;;
delimiter ;

