gr.id_estado = 20 and
usu.fecha_del is null and concat(gr.numero_guia,' ') like concat('%',busca,'%')
		ORDER BY ag.cuenta DESC
		LIMIT row1,length1;

	set totalRegistro =  (
	select 
			count(gr.id_guia_remision)
 from guia_remision gr 
INNER JOIN direcciones dr on gr.id_direccion_llegada = dr.id_direccion
INNER JOIN ubigeos ub on dr.id_ubigeo = ub.id_ubigeo
INNER JOIN agente ag on gr.id_agente = ag.id_agente
inner JOIN usuarios usu on ag.id_agente = usu.id_agente
WHERE 
gr.fecha_del is null and 
dr.fecha_del is null and 
ub.fecha_del is null and
ag.fecha_del is null and 
usu.id_usuario = usuario and
gr.id_estado = 20 and
usu.fecha_del is null and concat(gr.numero_guia,' ') like concat('%',busca,'%')
		
		);
		
		
		select totalRegistro INTO total;

		
END
;;
delimiter ;

