LEFT JOIN usuarios usu on agv.id_agente = usu.id_agente

WHERE 
gv.fecha_del is null and 
gv.ipmaq_del is null and
gvd.fecha_del is null and 
ub.fecha_del is null and
ag.fecha_del is null and
usu.id_usuario = usuario and 
gv.id_estado = 4 and
usu.fecha_del is null
and concat(gv.numero_guia,' ') like concat('%',buscar,'%');
		
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listadoSeguimientoAgBusca
-- ----------------------------
DROP PROCEDURE IF EXISTS `listadoSeguimientoAgBusca`;
delimiter ;;
CREATE PROCEDURE `listadoSeguimientoAgBusca`(IN row1 INT,IN length1 INT,IN buscar varchar(200),OUT total int, IN usuario INT)
BEGIN
SELECT 
gr.id_guia_remision,
CONCAT(gr.serie,'-',gr.numero_guia) as numero_guia,
ag.cuenta, 
usu.usuario, 
dr.direccion, 
CONCAT(ub.nombre_provincia,'- ',ub.nombre_distrito) as nombre_provincia, 
es.nombre_estado,
gr.fecha_traslado,
gr.id_agente,
'GRP' as tipo 
from guia_remision gr 
LEFT JOIN direcciones dr on gr.id_direccion_llegada = dr.id_direccion
LEFT JOIN ubigeos ub on dr.id_ubigeo = ub.id_ubigeo
LEFT JOIN agente ag on gr.id_agente = ag.id_agente
LEFT JOIN estados es on gr.id_estado = es.id_estado
LEFT JOIN usuarios usu on ag.id_agente = usu.id_agente
WHERE 
gr.fecha_del is null and 
dr.fecha_del is null and 
ub.fecha_del is null and
ag.fecha_del is null and 
usu.id_usuario = usuario and 
gr.id_estado = 20 and
usu.fecha_del is null  
 and concat(gr.numero_guia,' ') like concat('%',buscar,'%')
 
UNION all
SELECT 
gv.id_guia_venta as id_guia_remision,
CONCAT(gv.serie,'-',gv.numero_guia) as numero_guia,
agv.cuenta, 
usu.usuario,  
if( gvd.id_tipo_entrega=1,if(ag.cuenta is null, CONCAT(gvd.direccion_destinatario,'-',ub.nombre_distrito),ag.cuenta),
if( gvd.id_tipo_entrega=2, CONCAT(gvd.direccion_destinatario,'-',ub.nombre_distrito),ag.cuenta)	) as direccion, 
if( gvd.id_tipo_entrega=1,if( SUBSTRING(ag.cuenta,7,10) is null, CONCAT(ub.nombre_provincia,'-',ub.nombre_distrito),SUBSTRING(ag.cuenta,7,10) ),
if( gvd.id_tipo_entrega=2, CONCAT(ub.nombre_provincia,'-',ub.nombre_distrito),SUBSTRING(ag.cuenta,7,10) )	) as nombre_provincia,
es.nombre_estado,
gv.fecha as fecha_traslado,
gv.id_agente,
'GV' as tipo
from guia_venta gv 
#LEFT JOIN direcciones dr on gr.id_direccion_llegada = dr.id_direccion
inner join guia_venta_destino gvd on gv.id_guia_venta = gvd.id_guia_remision
LEFT JOIN agente ag on gvd.id_agente = ag.id_agente
LEFT JOIN ubigeos ub on gvd.id_ubigeo = ub.id_ubigeo
LEFT JOIN agente agv on gv.id_agente = agv.id_agente
LEFT JOIN estados es on gv.id_estado = es.id_estado
LEFT JOIN usuarios usu on agv.id_agente = usu.id_agente

WHERE 
gv.fecha_del is null and 
gv.ipmaq_del is null and
gvd.fecha_del is null and 
ub.fecha_del is null and
ag.fecha_del is null and
usu.id_usuario = usuario and 
gv.id_estado = 1 and
usu.fecha_del is null
and concat(gv.numero_guia,' ') like concat('%',buscar,'%');
		
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listadotipodocumento
