DROP PROCEDURE IF EXISTS `listadotipodocumento`;
delimiter ;;
CREATE PROCEDURE `listadotipodocumento`(IN row1 INT,IN length1 INT,IN busca varchar(200))
BEGIN
	select 
id_tipo_documento,
documento,
 
	(select count(*) from tipo_documentos where fecha_del is null) as total
	from tipo_documentos
  where fecha_del is null and documento like concat('%',busca,'%') ORDER BY id_tipo_documento DESC
		LIMIT row1,length1;
END
