-- ----------------------------
-- Procedure structure for listamanifiesto
-- ----------------------------
DROP PROCEDURE IF EXISTS `listamanifiesto`;
delimiter ;;
CREATE PROCEDURE `listamanifiesto`(IN row1 INT,IN length1 INT,IN busca varchar(200))
BEGIN
 
	SELECT 
   	grm.fecha,
		grm.serie,
		grm.id_remitente,
		c.razon_social,
		vh.id_vehiculo,
		vh.placa,
		(select count(*) from guia_remision where fecha_del is null) as total		
		
	FROM
		guia_remision grm 
		INNER JOIN entidades c ON grm.id_remitente = c.id_entidad
		INNER JOIN vehiculos vh ON grm.id_vehiculo = vh.id_vehiculo


	WHERE
		grm.fecha_del IS NULL and concat(grm.fecha,' ',	c.razon_social,'',vh.placa) like concat('%',busca,'%') 
		
		GROUP BY grm.fecha, grm.id_remitente, grm.id_vehiculo, grm.serie
		ORDER BY grm.id_guia_remision DESC
		
		LIMIT row1,length1;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listamanifiestoAuxiliar
-- ----------------------------
DROP PROCEDURE IF EXISTS `listamanifiestoAuxiliar`;
delimiter ;;
CREATE PROCEDURE `listamanifiestoAuxiliar`(IN row1 INT, IN length1 INT, IN busca VARCHAR ( 200 ), IN id_auxiliar INT)
BEGIN
	SELECT
		grm.fecha,
		grm.serie,
		grm.id_remitente,
		c.razon_social,
		vh.id_vehiculo,
		vh.placa,
		us.usuario,
		( SELECT COUNT(gr.id_usuario_reg) 
		FROM guia_remision gr
		INNER JOIN usuarios usu ON gr.id_usuario_reg = usu.id_usuario
		WHERE gr.fecha_del IS NULL and gr.id_usuario_reg = id_auxiliar ) AS total 
	FROM
		guia_remision grm
		INNER JOIN entidades c ON grm.id_remitente = c.id_entidad
		INNER JOIN vehiculos vh ON grm.id_vehiculo = vh.id_vehiculo
		INNER JOIN usuarios us ON grm.id_usuario_reg = us.id_usuario
	WHERE
		grm.fecha_del IS NULL and grm.numero_guia is not null and us.id_usuario=id_auxiliar
		AND concat( grm.fecha, ' ', c.razon_social, '', vh.placa ) LIKE concat( '%', busca, '%' ) 
	GROUP BY
		grm.fecha,
		grm.id_remitente,
		grm.id_vehiculo,
		grm.serie 
	ORDER BY
		grm.id_guia_remision DESC 
		LIMIT row1,
		length1;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listamanifiestov
-- ----------------------------
DROP PROCEDURE IF EXISTS `listamanifiestov`;
delimiter ;;
CREATE PROCEDURE `listamanifiestov`(IN row1 INT,IN length1 INT,IN busca varchar(200))
BEGIN
 
	SELECT 
   	grm.fecha,
		grm.serie,

     (SELECT id_entidad from entidades where id_entidad=171) as id_remitente,		
	 
			(SELECT razon_social from entidades where id_entidad=171) as razon_social,
		(select count(*) from guia_venta where fecha_del is null) as total		
		
	FROM
		guia_venta grm 
	 
		INNER JOIN vehiculos vh ON grm.id_vehiculo = vh.id_vehiculo
 

	WHERE
		grm.fecha_del IS NULL and concat(grm.fecha,'',vh.placa) like concat('%',busca,'%') 
		
		GROUP BY grm.fecha, grm.serie
		ORDER BY grm.id_guia_venta DESC
		
		LIMIT row1,length1;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for listaPedidosAte
-- ----------------------------
DROP PROCEDURE IF EXISTS `listaPedidosAte`;
delimiter ;;
CREATE PROCEDURE `listaPedidosAte`(IN row1 INT, IN length1 INT, IN busca VARCHAR ( 200 ))
BEGIN
	SELECT
		pc.id_pedido_cliente,
		pc.fecha,
		pc.nm_solicitud,
		u.usuario,
		pc.hora_recojo,
		pc.id_usuario_reg,
		pc.tipo_servicio,
		ts.nombre_producto AS tipo_servicios,
		es.nombre_estado,
		pe.nombres,
		CONCAT(pea.nombres ,' ',pea.apellido_paterno ) as auxiliar,
		en.razon_social,
		CONCAT(vh.placa,' - ', vh.descripcion) as vehiculo,
		( SELECT count( * ) FROM pedido_cliente WHERE fecha_del IS NULL ) AS total 
	FROM
		pedido_cliente pc 
	
		LEFT JOIN productos ts ON pc.tipo_servicio = ts.id_producto
		LEFT JOIN estados es ON pc.id_estado = es.id_estado 
	  LEFT join atencion_pedidos ate on pc.id_pedido_cliente = ate.id_pedido_cliente
		LEFT JOIN vehiculos vh on ate.unidad = vh.id_vehiculo
	  LEFT JOIN empleados ep on ate.conductor = ep.id_empleado
		LEFT JOIN empleados epl on ate.auxiliar = epl.id_empleado
	  LEFT JOIN personas pe on ep.id_persona = pe.id_persona
		LEFT JOIN personas pea on 	epl.id_persona = pea.id_persona
	
		LEFT JOIN usuarios u on pc.id_usuario_reg = u.id_usuario
		LEFT JOIN entidades en on pc.id_cliente = en.id_entidad
		
	#	LEFT JOIN personas peu on pc.id_persona = peu.id_persona
 	
	WHERE
		pc.fecha_del IS NULL 
		AND concat( pc.fecha, ' ', pc.hora_recojo, ' ', pc.tipo_servicio ) LIKE concat( '%', busca, '%' ) 
	ORDER BY
		pc.fecha_reg DESC 
		LIMIT row1,
		length1;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for manifiesto
-- ----------------------------
DROP PROCEDURE IF EXISTS `manifiesto`;
delimiter ;;
CREATE PROCEDURE `manifiesto`(IN fecha CHAR(20), IN id_remitente INT, IN id_vehiculo INT, IN serie VARCHAR(20))
BEGIN
 
		
	SELECT
		gr.fecha,
	  gr.fecha_reg,
		r.razon_social AS remitente,
	  r.id_entidad as id_remitente,
		dlu.nombre_provincia AS destino,
		d.razon_social AS destinatario,	
		gr.serie,
		concat( gr.serie, '-', gr.numero_guia ) AS numero_guia,
		grc.gr as guia_cliente,
		dgr.peso, 
		pro.unidad_medida,
		v.nombre_via AS via,
	  a.agente,
    grc.ft,
		dgr.cantidad,
		gr.transportista,
		gr.factura_transportista,
		gr.guia_remision_transportista,
		gr.importe_transportista,
		CONCAT(pe.nombres,' ', pe.apellido_paterno,' ',pe.apellido_materno)	as conductor,
		CONCAT(peu.nombres,' ',peu.apellido_paterno, '',peu.apellido_materno ) as auxiliar,
		
		vh.placa  as placa
 
	FROM
		guia_remision gr
		LEFT JOIN direcciones dll ON gr.id_direccion_llegada = dll.id_direccion	
		LEFT JOIN entidades r ON gr.id_remitente = r.id_entidad
		LEFT JOIN entidades d ON gr.id_destinatario = d.id_entidad
		LEFT JOIN entidades c ON gr.id_cliente = c.id_entidad
		LEFT JOIN guia_remision_cliente grc ON gr.id_guia_remision = grc.id_guia_remision		
		LEFT JOIN via v ON gr.id_via = v.id_via
		LEFT JOIN agente a on gr.id_agente = a.id_agente
		LEFT JOIN ubigeos dlu on dll.id_ubigeo = dlu.id_ubigeo
		LEFT join detalle_guia_remitente dgr on gr.id_guia_remision = dgr.id_guia_remision
 		LEFT join productos pro on dgr.id_producto = pro.id_producto
		LEFT JOIN empleados em on gr.id_conductor = em.id_empleado
			LEFT JOIN personas pe on em.id_persona = pe.id_persona
			LEFT JOIN usuarios usu on gr.id_usuario_reg = usu.id_usuario
			LEFT JOIN personas peu on usu.id_persona = peu.id_persona
			left join vehiculos vh on gr.id_vehiculo = vh.id_vehiculo


		
	WHERE
		gr.fecha_del IS NULL AND concat( gr.numero_guia, ' ', r.razon_social, ' ', d.razon_social ) 
		AND gr.fecha = fecha and gr.id_remitente = id_remitente and gr.id_vehiculo = id_vehiculo and gr.serie=serie;
	
	 
 	 

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for manifiestov
-- ----------------------------
DROP PROCEDURE IF EXISTS `manifiestov`;
delimiter ;;
CREATE PROCEDURE `manifiestov`(IN fecha CHAR(20), IN serie VARCHAR(20))
BEGIN
 		
	SELECT
	CONCAT('') as item,
	gr.fecha, 
 	r.razon_social as cliente,
	if( ag.cuenta is null, CONCAT(ub.nombre_provincia,'-',ub.nombre_distrito),ag.cuenta ) as destino1,
	 
	if( gvd.id_tipo_entrega=1,if( ag.cuenta is null, CONCAT(ub.nombre_provincia,'-',ub.nombre_distrito),ag.cuenta ),
if( gvd.id_tipo_entrega=2, CONCAT(ub.nombre_provincia,'-',ub.nombre_distrito),ag.cuenta )	) as destino,	

	concat( gr.serie, '-', gr.numero_guia ) AS numero_guia,
	gr.guia_cliente as guia_cliente,
	gr.factura_boleta as fact_boleta,
	dgv.cantidad as bultos,
	dgv.peso as peso,
	dgv.descripcion_producto as descripcion,
	va.nombre_via as via,
	te.descripcion as entrega,
	es.nombre_estado as estado,
	esv.nombre_estado as estado_venta,
  CONCAT(gvd.nombres_destinatario ,' ',gvd.apellidos_destinatario, ' - ', gvd.celular_destinatario ) as contacto,
	dgv.monto_envio as monto  
 
	FROM
		guia_venta gr
		 
		LEFT JOIN clientes_ventas r ON gr.id_entidad_ = r.id_entidad 
		LEFT JOIN detalle_guia_venta dgv ON gr.id_guia_venta = dgv.id_guia_venta
		LEFT JOIN via va ON dgv.id_forma_envio = va.id_via
		LEFT JOIN guia_venta_destino gvd on gr.id_guia_venta=gvd.id_guia_remision
		LEFT JOIN tipo_entrega te ON gvd.id_tipo_entrega = te.id_tipo_entrega
		LEFT JOIN estados es ON gr.id_estado = es.id_estado
		LEFT JOIN estados_venta esv ON gr.id_estados_venta = esv.id_estado_venta
		LEFT JOIN agente ag on gvd.id_agente = ag.id_agente
		LEFT JOIN ubigeos ub on gvd.id_ubigeo = ub.id_ubigeo



	WHERE
		gr.fecha_del IS NULL AND concat( gr.numero_guia, ' ', r.razon_social) 
		AND gr.fecha = fecha and gr.serie=serie;
	
	   
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for menu
