-- ----------------------------
-- Procedure structure for mostarEntidad
-- ----------------------------
DROP PROCEDURE IF EXISTS `mostarEntidad`;
delimiter ;;
CREATE PROCEDURE `mostarEntidad`(IN idUsuario INT)
BEGIN
	SELECT
		en.razon_social,
		en.id_entidad 
	FROM
		usuarios us
		INNER JOIN personas pe ON us.id_persona = pe.id_persona
		INNER JOIN entidades en ON pe.id_entidad = en.id_entidad 
	WHERE
		us.fecha_del IS NULL 
		AND us.id_usuario = idUsuario;

