-- ----------------------------
-- Procedure structure for tarifaEntidad
-- ----------------------------
DROP PROCEDURE IF EXISTS `tarifaEntidad`;
delimiter ;;
CREATE PROCEDURE `tarifaEntidad`(IN entidad INT)
begin 
 
SELECT
	dgr.peso,
	dgr.volumen,	 
	te.tarifa_m_a_c_ref as tarifa_costo_ref,
	tpe.tarifa_m_a_vr AS tarifa_minima_pro,
	 
  	if(tp.nombre = 'REFRIGERADO', 
      (  case 
        WHEN  dgr.peso > dgr.volumen AND dgr.peso > 5.00 and va.nombre_via = 'AEREO' AND dgr.peso > 5.00 THEN
			   ( ( dgr.peso - 5.00 ) * tpe.tarifa_m_a_vr ) + te.tarifa_m_a_total_ref 
				 
		WHEN  dgr.peso < dgr.volumen  and va.nombre_via = 'AEREO'  AND dgr.volumen > 5.00 
		
		THEN
			   ( ( dgr.volumen - 5.00) * tpe.tarifa_m_a_vr ) + te.tarifa_m_a_c_ref 
				 
