DROP PROCEDURE IF EXISTS `tarifas`;
delimiter ;;
CREATE PROCEDURE `tarifas`(in entidad int)
BEGIN
SELECT 
x.FECHA,
X.GUIA_PEGASO,
X.GUIA_PEGASO AS GUIA_CLIENTE,
X.ORIGEN,
X.DESTINO,
x.precio_destino,
X.BULTOS,
x.PESO,
x.volumen,
x.pesos,
X.DESCD,
X.VIA,
max(x.Refrigerado) as Refrigerado,
x.SECO	,
x.SOBRE	,
x.nombre AS TIPO_CARGA,
X.TARIFA_BASE,
X.TARIFA_AEREA,
X.PESO_EXCESO,
X.TARIFA_EXCESO,
x.REEMBARQUE,
x.SECO + x.SOBRE	+ x.Refrigerado as SUBTOTAL,
(x.SECO + x.SOBRE	+ x.Refrigerado) *0.18 AS IGV,
((x.SECO + x.SOBRE	+ x.Refrigerado) *0.18)+ (x.SECO + x.SOBRE	+ x.Refrigerado) AS TOTAL

 

from (

SELECT
	gr.fecha as FECHA,
		CONCAT(gr.serie, '-',gr.numero_guia ) AS GUIA_PEGASO,
		ub.nombre_provincia AS ORIGEN,
		ubl.nombre_provincia AS DESTINO,
		tpe.tarifa_m_a_cg as precio_destino,
		
		dgr.cantidad AS BULTOS,
		
		CASE 
		WHEN dgr.peso is null then dgr.volumen
		WHEN dgr.volumen is null then dgr.peso
		when dgr.peso > dgr.volumen THEN dgr.peso
		when dgr.volumen > dgr.peso THEN dgr.volumen
    when dgr.volumen = dgr.peso THEN dgr.volumen
 	  End as PESO,
		
		dgr.volumen as volumen,
		dgr.peso as pesos,
		
		tp.nombre as DESCD, 
	  va.nombre_via AS VIA,
		te.tarifa_m_t_costo as TARIFA_BASE,
  	te.tarifa_m_a_c as TARIFA_AEREA,
		CASE 
		WHEN dgr.peso > 5.00 and dgr.peso > dgr.volumen then (dgr.peso - 5.00)
		when dgr.volumen > 5.00 and dgr.volumen > dgr.peso then (dgr.volumen - 5.00)
		when dgr.volumen < 5.00  then ('')
		WHEN dgr.peso < 5.00 then ('')
		WHEN dgr.peso is null and dgr.volumen > 5.00 then dgr.volumen-5.00
		WHEN dgr.volumen is null and dgr.peso >5.00 then dgr.peso-5.00
 
    when dgr.volumen = dgr.peso and dgr.volumen > 5.00 THEN dgr.volumen -5.00
		end as PESO_EXCESO,
		
		if(tp.nombre = 'REFRIGERADO', 
			
    if(va.nombre_via='AEREO', 
		  ( case 
    WHEN  dgr.peso > dgr.volumen and  dgr.peso > 5.00 THEN
			    CONCAT((( ( dgr.peso - 5.00 ) * tpe.tarifa_m_a_vr ) + te.tarifa_m_a_c_ref))
		WHEN  dgr.peso < dgr.volumen  AND dgr.volumen > 5.00 THEN
				CONCAT((( ( dgr.volumen - 5.00 ) * tpe.tarifa_m_a_vr ) + te.tarifa_m_a_c_ref))				 
	    
		WHEN  dgr.peso = dgr.volumen AND dgr.peso > 5.00 THEN
			    CONCAT(( ( ( dgr.peso - 5.00 ) * tpe.tarifa_m_a_vr ) + te.tarifa_m_a_c_ref))
				 #-------------------------------------------------------	 
		WHEN  dgr.peso > dgr.volumen  AND dgr.peso < 5.00 THEN (te.tarifa_m_a_c_ref )		
		WHEN  dgr.peso < dgr.volumen  AND dgr.peso < 5.00 THEN (te.tarifa_m_a_c_ref )				 
		WHEN  dgr.peso = dgr.volumen  AND dgr.peso < 5.00 THEN (te.tarifa_m_a_c_ref )
				
				#-------------------------------------------------------	
				
		WHEN  dgr.peso is null  and   dgr.volumen > 5.00 THEN
			   (( dgr.volumen - 5.00 ) * tpe.tarifa_m_a_vr ) + te.tarifa_m_a_c_ref 			 
		WHEN  dgr.volumen is null  and   dgr.peso > 5.00 THEN
		       (( dgr.peso - 5.00 ) * tpe.tarifa_m_a_vr ) + te.tarifa_m_a_c_ref 
		WHEN  dgr.peso is null  AND dgr.volumen < 5.00 THEN (te.tarifa_m_a_c_ref )				
    WHEN  dgr.volumen is null AND dgr.peso < 5.00 THEN (te.tarifa_m_a_c_ref )

		WHEN  dgr.peso = dgr.volumen  AND dgr.peso < 5.00 THEN (te.tarifa_m_a_c_ref )
				
		       #-------------------------------------------------------	 
	    END ), 
			#TERRESTRE-------------------------------------------------------
			( case 
        WHEN  dgr.peso > dgr.volumen and  dgr.peso > 5.00 THEN
			   CONCAT((( ( dgr.peso - 5.00 ) * tpe.tarifa_m_t_ref ) + te.tarifa_m_t_costo_ref))
		WHEN  dgr.peso < dgr.volumen  AND dgr.volumen > 5.00 THEN
				  CONCAT((( ( dgr.volumen - 5.00 ) * tpe.tarifa_m_t_ref ) + te.tarifa_m_t_costo_ref))
	 				 
	    WHEN  dgr.peso = dgr.volumen AND dgr.peso > 5.00 THEN
			  CONCAT(( ( ( dgr.peso - 5.00 ) * tpe.tarifa_m_t_ref ) + te.tarifa_m_t_costo_ref))
				 
			#-------------------------------------------------------	 
		WHEN  dgr.peso > dgr.volumen OR dgr.peso < dgr.volumen OR dgr.peso = dgr.volumen AND dgr.peso < 5.00  THEN (te.tarifa_m_t_costo_ref )
		
	#  WHEN  dgr.peso < dgr.volumen  AND dgr.peso < 5.00 THEN (te.tarifa_m_t_costo_ref )
				 
	#	WHEN  dgr.peso = dgr.volumen  AND dgr.peso < 5.00 THEN (te.tarifa_m_t_costo_ref )
				
				#-------------------------------------------------------	
				
