	      tp.nombre,	 
			 
				gr.numero_guia
	  
			FROM
				tarifa_entidad te
				INNER JOIN entidades en ON te.id_entidad = en.id_entidad
				INNER JOIN guia_remision gr ON te.id_entidad = gr.id_cliente
				INNER JOIN via va ON gr.id_via = va.id_via
				INNER JOIN direcciones dri ON gr.id_direccion_partida = dri.id_direccion
				INNER JOIN direcciones drl ON gr.id_direccion_llegada = drl.id_direccion
				INNER JOIN ubigeos ub ON dri.id_ubigeo = ub.id_ubigeo
				INNER JOIN ubigeos ubl ON drl.id_ubigeo = ubl.id_ubigeo
				INNER JOIN tarifa_provincia_ent tpe ON en.id_entidad = tpe.id_tarifa_entidad
				INNER JOIN ubigeos ubt ON tpe.id_provincia = ubt.id_ubigeo
				INNER JOIN detalle_guia_remitente dgr ON gr.id_guia_remision = dgr.id_guia_remision 
				INNER JOIN guia_remision_cliente grc on gr.id_guia_remision = grc.id_guia_remision
				inner JOIN tipo_carga tp on grc.id_tipo_carga = tp.id_tipo_carga 
			WHERE
				te.fecha_del IS NULL 
				AND gr.fecha_del IS NULL
			  AND grc.fecha_del IS NULL 
				AND dgr.fecha_del IS NULL 	
				AND ubl.id_ubigeo = ubt.id_ubigeo 
				AND en.numero_documento IS NOT NULL
				AND en.id_entidad = entidad
			 ##AND gr.numero_guia = 83785
			)	as x
				
  group by x.numero_guia;
	end
